INSERT INTO `gk_productos` (`pro_id`, `pro_nombre`, `pro_key`, `pro_descripcion`, `pro_video`, `pro_precio`, `pro_precio_oferta`, `pro_descuento`, `pro_valor_a`, `pro_valor_b`, `pro_oferta`, `pro_destacar`, `pro_estado`, `pro_fecha`, `pro_fecha_update`, `pro_description`, `pro_keywords`, `pro_analytics`, `pro_orden`) VALUES
(1, 'Ajedrez Casino Hexagonal', 'ajedrez-casino-hexagonal', '<p>Medida de 1.10m de di&aacute;metro, el mueble esta elaborado en madera tornillo, enchapado con enchape Jacaranda acabado en laca, a la piroxilina, tablero  reversible (una cara forrada de pa&ntilde;o de color verde, la otra cara enchapado de ajedrez) se entrega con un juego de casino, un cubilete de cuero, un juego de fichas de ajedrez de madera torneada.</p>', '', '1350.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(2, 'Mesa de Ajedrez', 'mesa-de-ajedrez', '<p>Medida 0.70 cm x 0.70 cm x 0.75 cm de altura</p>\r\n<p>Mueble elaborado en madera tornillo, enchapado con enchape Jacaranda acabado en laca, se entrega con un juego de casino, un cubilete de cuero, un juego de fichas de ajedrez de madera torneada.</p>', NULL, '850.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-01-06 12:42:13', NULL, NULL, NULL, NULL),
(3, 'Cubilete de cuero', 'cubilete-de-cuero', '<p>Confeccionado en cuero con figuras, medidas de 8 cm. de altura x 7 cm. de di&aacute;metro con 5 dados.</p>', NULL, '17.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(4, 'Cubilete para casino', 'cubilete-para-casino', '<p>Cubilete para casino</p>', NULL, '68.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(5, 'Juego de bingo', 'juego-de-bingo', '<p>Juego de bingo</p>', NULL, '200.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(6, 'Juego de dardos', 'juego-de-dardos', '<p>Juego de dardos</p>', NULL, '80.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(7, 'Maletin completo de fichas de casino', 'maletin-completo-de-fichas-de-casino', '<p>Maletin completo de fichas de casino</p>', NULL, '750.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-09-30 17:16:30', NULL, NULL, NULL, NULL),
(8, 'Tablero de ajedrez ', 'tablero-de-ajedrez', '<p>Medidas de 0.42 cm. X 0.42cm.  Con fichas de ajedrez y damas de madera torneada.</p>', NULL, '280.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(9, 'Maletin con fichas de casino', 'maletin-con-fichas-de-casino', '<p>Maletin con fichas de casino</p>', NULL, '400.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-12-06 16:32:43', NULL, NULL, NULL, NULL),
(10, 'Tablero acolchado de casino octogonal ', 'tablero-acolchado-de-casino-octogonal', '<p>Tablero acolchado de casino octogonal</p>', NULL, '900.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-05-04 22:13:50', NULL, NULL, NULL, NULL),
(11, 'Tablero acolchado de poker ovalado', 'tablero-acolchado-de-poker-ovalado', '<p>Tablero acolchado de poker ovalado</p>', NULL, '620.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-09-30 17:22:58', NULL, NULL, NULL, NULL),
(12, 'Banca de Parque con braceras', 'banca-de-parque-con-braceras', '<p>Elaborado en fierro fundido, pintado en esmalte al horno color aluminio asientos de madera tornillo y/o huayruro de 1&frac12;&rdquo; x 2&rdquo; laqueado y barnizado con barniz marino color natural tiene como longitud 1.80m.</p>', NULL, '750.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(13, 'Banca de Parque', 'banca-de-parque', '<p>Elaborado en fierro fundido, pintado en esmalte al horno color aluminio asientos de madera tornillo y/o huayruro de 1&frac12;&rdquo; x 2&rdquo; laqueado y barnizado con barniz marino color natural tiene como longitud 1.80m.</p>', NULL, '880.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-05-04 22:15:10', NULL, NULL, NULL, NULL),
(14, 'Mesa de camping con banca', 'mesa-de-camping-con-banca', '<p>Hecho en madera a elegir (capirona, huairuro y tornillo) totalmente laqueado y barnizado color natural.</p>\r\n<p><strong>Medidas :</strong></p>\r\n<p>Mesa de 0.80 mts ancho x  1.80 mts largo x  0.80cm altura.</p>\r\n<p>Asientos de 0.40cm altura y 1.80mt de largo x 0.25 mt de ancho.</p>', NULL, '1800.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-11-07 12:08:53', NULL, NULL, NULL, NULL),
(159, 'Playground Laberinto', 'playground-laberinto', '<p>Confeccionado en tubo negro de 1 &frac14; x 2mm pintado en esmalte al horno color aluminio en acolchado a con espuma de 2&rdquo; de espesor y forrado con lona concord en 4 colores asimismo el techo. La tina de piscina es de lona concord con canastilla de correas de nylon en cual es debidamente cocido con hilo nylon, templada con resortes de 18 cm. El juego esta cerrado con una malla de nylon color verde para su mayor resistencia, el ingreso a la piscina es circular acolchado y forrado, incluye una escalera de metal con paso de madera, 6 porta zapateras y 5,000 pelotas.</p>', NULL, '52800.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-11', '2011-10-15 11:21:06', NULL, NULL, NULL, NULL),
(15, 'Arco de fulbito', 'arco-de-fulbito', '<p>Confeccionado con Tubo Negro Estructural de 2&rdquo; x 2mm. Estructura pintado con esmalte al horno color blanco. Incluye maya Alquitranada.</p>\r\n<p>Medidas de arco: 3x2 mts.</p>', NULL, '2200.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-11-21 17:25:31', NULL, NULL, NULL, NULL),
(16, 'Arco de fulbito con castillo aéreo de básquet', 'arco-de-fulbito-con-castillo-aereo-de-basquet', '<p>Confeccionado en tubo negro estructural de 2&rdquo; x 2mm y &frac34; x 2mm, bastidor de metal tubo cuadrado de 1&rdquo; x 1.5mm, estructuras pintado con esmalte al horno color blanco, tablero de placa maciza de 18mm de espesor pintado al duco color blanco y filetes negros con aro y canastilla de nylon.</p>\r\n<p><strong>MEDIDAS:</strong></p>\r\n<p>Tablero 		: 1.80m x 1.20m. <br /> Altura de Aro 	: 3.05m. <br /> Arco 			: 3m x 2m.</p>', NULL, '4300.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-11-07 12:08:34', NULL, NULL, NULL, NULL),
(17, 'Parantes de vóley', 'parantes-de-voley', '<p>Medida: 2.48 m de altura, confeccionado en tubo negro y pintado al horno, se entrega con malla con cables.</p>', '', '1100.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-12-06 16:34:12', NULL, NULL, NULL, NULL),
(18, 'Tablero de básquet', 'tablero-de-basquet', '<p>Confeccionado en aglomerado de pino de 18mm pintado al duco color blanco con rayas rojas o negras bastidor de tubo cuadrado de 1&rdquo; x 1.5mm pintado al horno color negro, incluye aro de metal y malla de nylon.</p>', NULL, '1200.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-11-07 12:12:28', NULL, NULL, NULL, NULL),
(19, 'Parantes de basquet amateur ', 'parantes-de-basquet-amateur', '<p>Confeccionado en tubo cuadrado de 4&rdquo; con sistema de tornillo sinf&iacute;n regulable (2.70m, 3.05m) pintado con esmalte al horno color negro o blanco, con pesa de cemento, tablero de vidrio templado 0.90cm x 1.20m x 0.10mm de espesor, incluye aro de metal y malla de nylon.</p>', NULL, '4300.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(20, 'Parantes de basquet regulable anclado', 'parantes-de-basquet-regulable-anclado', '<p>Confeccionado en tubo cuadrado de 5&rdquo; con sistema de tornillo sinf&iacute;n regulable (2.70m, 3.05m) pintado con esmalte al horno color negro o blanco, anclado al piso con concreto armado de cemento, tablero de vidrio templado 1.05m x 1.80m x 0.10mm de espesor, incluye aro de metal y malla de nylon.</p>', '', '5200.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-05-04 22:10:23', NULL, NULL, NULL, NULL),
(21, 'CDP Modelo payaso ', 'cdp-modelo-payaso', '<p>Confeccionado en fibra de vidrio pintado con esmalte al horno con un di&aacute;metro de 0.60cm.</p>', NULL, '450.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(22, 'Papelera modelo delfín', 'papelera-modelo-delfin', '<p>Confeccionado en fibra de vidrio de 4mm pintado con esmalte al horno.</p>', NULL, '770.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-10-18 14:47:24', NULL, NULL, NULL, NULL),
(23, 'CDP modelo gato ', 'cdp-modelo-gato', '<p>Confeccionado en fibra de vidrio pintado con esmalte al horno con un di&aacute;metro de 0.60cm.</p>', NULL, '450.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(74, 'CDP modelo barney', 'cdp-modelo-barney', '<p>Confeccionado en fibra de vidrio pintado con esmalte al horno con un di&aacute;metro de 0.60cm.</p>', NULL, '352.00', NULL, NULL, NULL, NULL, 0, NULL, 2, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(24, 'CDP modelo pollo', 'cdp-modelo-pollo', '<p>Confeccionado en fibra de vidrio pintado con esmalte al horno con un di&aacute;metro de 0.60cm.</p>', NULL, '450.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(25, 'Mesa de billas A (madera tornillo)', 'mesa-de-billas-a-(madera-tornillo)', '<p>Medida 2.80m x 1.55m x 0.80m confeccionado en madera tornillo selecto, bandas enchapadas en formica post formable color caoba, pizarra de cemento (composici&oacute;n nacional), pa&ntilde;o polyestel color verde o al escoger, troneras de bronce pulido canastillas de cuero vira, barandas con jebe nacional incluye los siguientes.</p>\r\n<p>Un juego de bolas importadas (16) (bolas chinas no recomendadas)<br /> Seis tacos fijos <br /> Un tri&aacute;ngulo y caja de bolas <br /> Una taquera  bolera <br /> Dos docena de tizas f&eacute;nix (tizas Chinas no recomendables)</p>', NULL, '5280.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-05-04 22:08:27', NULL, NULL, NULL, NULL),
(26, 'Mesa de billas (madera caoba)', 'mesa-de-billas-(madera-caoba)', '<p>Medida 2.80m x 1.55m x 0.80m confeccionado en madera caoba y laqueado en laca poli&eacute;ster color natural, pizarra de cemento (composici&oacute;n nacional), tela polyestel color verde o al escoger, troneras de bronce pulido, canastillas de cuero vira, barandas con jebe nacional, incluye los siguientes accesorios:</p>\r\n<p>Un juego de bolas importadas (16) (bolas chinas no recomendadas)<br /> Seis tacos fijos <br /> Un tri&aacute;ngulo y caja de bolas <br /> Una taquera  bolera <br /> Dos docena de tizas f&eacute;nix (tizas chinas no recomendables)</p>', NULL, '7000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(27, 'Mesa de billas (enchapada en formica)', 'mesa-de-billas-(enchapada-en-formica)', '<p>Medidas de 2.80m x 1.55m x 0.80cm confeccionado en madera tornillo y aglomerado de pino (placa masisa), enchapado en formica post formable color caoba; pizarra de cemento (composici&oacute;n nacional), tela polystel color verde o al escoger, troneras de bronce pulido, canastillas de cuero vira, barandas con  jebe nacional, incluye los siguientes accesorios:</p>\r\n<p>Un juego de bolas importadas (16) <br /> Seis tacos fijos <br /> Un triangulo y cajas de bolas. <br /> Una taquera bolera. <br /> Dos docena de tizas f&eacute;nix (tizas chinas no recomendables).</p>', NULL, '1300.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(28, 'Mesa de billas (madera tornillo)', 'mesa-de-billas-(madera-tornillo)', '<p>Medida 2.80m x 1.55m x 0.80m confeccionado en madera tornillo selecto, bandas enchapadas en formica post formable color caoba, pizarra de cemento (composici&oacute;n nacional), tela polyestel color verde o al escoger, troneras de bronce pulido canastillas de cuero vira, barandas con jebe nacional incluye los siguientes.</p>\r\n<p>Un juego de bolas importadas (16) <br /> Seis tacos fijos <br /> Un tri&aacute;ngulo y caja de bolas <br /> Una taquera  bolera <br /> Dos docena de tizas f&eacute;nix (tizas Chinas no recomendables)</p>', NULL, '2530.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(29, 'Taburete de colores', 'taburete-de-colores', '<p>Confeccionado en madera huayruro y completamente laqueado y dividido  en 6 cuerpos.</p>', NULL, '880.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(30, 'Taburete de gimnasia', 'taburete-de-gimnasia', '<p>Confeccionado en madera huayruro y completamente laqueado y dividido  en 5 cuerpos.</p>', NULL, '880.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(31, 'Taburete 3 PZS', 'taburete-3-pzs', '<p>Dimensiones del juego armado: <br />Alto: 75 cm. <br />Largo: 90 cm. <br />Ancho: 75 cm <br /> Colores: azul, amarillo, rojo <br /> Piezas: 3 <br /> Materiales: lino plastificado lavable y espuma de alta densidad</p>', NULL, '600.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(32, 'Mesa de ping pong americano ', 'mesa-de-ping-pong-americano', '<p>Medidas 1.52 &frac12;.m x 2.74m estructura confeccionado en tubo cuadrado de 1&rdquo; y ⅞&rdquo; plegable y pintado con esmalte al horno color negro o gris, consta de 4 garruchas que  permite que la mesa pueda deslizarse, tiene dos tableros de 15mm de aglomerado de pino (placa maciza), pintado a la piroxilina (duco) color verde pizarra o azul en acabado mate, incluye un juego de accesorios (2 paletas, 2 parantes, 1 malla, 3 pelotas).</p>', NULL, '715.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-01-06 12:05:09', NULL, NULL, NULL, NULL),
(33, 'Mesa de ping pong jumbo', 'mesa-de-ping-pong-jumbo', '<p>Medida 1.52 &frac12;&rdquo; m x 2.74m estructura confeccionado en tubo rectangular de 2&rdquo; x 1&rdquo; x 1.5 plegable y pintado con esmalte al horno color negro, blanco, gris. La estructura es gruesa y consta de  4 rodajes internos por tablero para que pueda abrirse los tableros, consta de 4 garruchas que permite que la mesa pueda deslizarse, tiene dos tableros de 15mm de aglomerado de pino (placa maciza), pintado a la piroxilina (duco) color verde pizarra o azul en acabado mate, incluye un juego de accesorios (2 paletas, 2 parantes, 1malla, 6 pelotas).</p>', NULL, '935.00', NULL, NULL, NULL, NULL, 0, 0, 2, '2011-09-30', '2011-11-07 12:10:25', NULL, NULL, NULL, NULL),
(34, 'Mesa de ping pong exportacion', 'mesa-de-ping-pong-exportacion', '<p>Medida 1.52 &frac12;&rdquo; m x 2.74m estructura confeccionado en tubo negro de 1 &frac12;&rdquo; x 1 &frac12;&rdquo; x 0.9 mm, 1 x 2 x 0.9 mm y &frac12;&rdquo; x 1 &frac12;&rdquo; x 0.9 mm, plegable y pintado con esmalte al horno color negro, blanco, gris. La estructura es gruesa y consta de  4 rodajes internos por tablero para que pueda abrirse los tableros, consta de 8 garruchas individual que permite que la mesa pueda deslizarse, tiene dos tableros de 18mm de aglomerado de pino (placa maciza), pintado a la piroxilina (duco) color verde pizarra o azul en acabado mate, incluye un juego de accesorios (2 paletas, 2 parantes, 1malla, 6 pelotas).</p>', '', '1350.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-10-18 14:43:40', NULL, NULL, NULL, NULL),
(35, 'Sapo típico ', 'sapo-tipico', '<p>Medidas 60cm x 60cm x 90cm el mueble esta confeccionado en madera tornillo, pintado con pintura sint&eacute;tica color verde, tambi&eacute;n puede ser de color natural acabado en laca, el cabezal y la numeraci&oacute;n del sapo est&aacute;n forrados con carnaza selecta para que proteja a la madera del golpe de la ficha de bronce; los accesorios son de bronce pulido (sapo, mariposa, balancines, seguros y 12 fichas) se le entrega con una pizarrita.</p>', NULL, '490.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-12-07 09:45:00', NULL, NULL, NULL, NULL),
(36, 'Sapo desarmable ', 'sapo-desarmable', '<p>Medidas 60cm x 0.60cm x 90cm el mueble esta confeccionado en madera tornillo, laqueado en color natural, todas las piezas son desarmables y codificadas para mayor facilidad en el armado, los accesorios son de bronce pulido (sapo, mariposa, balancines, seguros y 12 fichas) se le entrega con una pizarrita (peso de 28 kilos).Se le entrega desarmado dentro de un malet&iacute;n elaborado de lona para su transporte.</p>', NULL, '550.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-11-07 12:07:31', NULL, NULL, NULL, NULL),
(37, 'Sapo eléctrico ', 'sapo-electrico', '<p>Elaborado de madera tornillo y placa masisa de 19mm, el tablero superior totalmente revestido en cuero carnaza, enchapado en formica, sistema el&eacute;ctrico empotrado en mueble, panel luminoso de acr&iacute;lico blanco con 20 focos, accesorios de bronce pulido (sapo, mariposa, balancines y fichas).</p>', NULL, '880.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(38, 'Hockey americano (1.m x 2.m)', 'hockey-americano-(1m-x-2m)', '<p>Mueble confeccionado en aglomerado de pino de 19mm (placa masisa), enchapado en formica y el color al escoger y esquineros de fibra de vidrio, cancha de formica color blanco marco de aluminio  pintados de color, marcadores electr&oacute;nicos con temporizador regulable y pantalla de iluminaci&oacute;n color lila, incluye como accesorios: dos mandos blancos y una ficha de juego color verde fosforescentes de confecci&oacute;n americana, incluye 50 fichas, amperaje 4.5 amperios- 220 voltios.</p>', NULL, '6000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(39, 'Hockey accesorios', 'hockey-accesorios', '<p>Mando S/. 70.00</p>\r\n<p>Ficha S/. 45.00</p>', NULL, '0.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(40, 'Fulbito comercial bombe', 'fulbito-comercial-bombe', '<p>Medidas 1.40m x 0.73 cm confeccionado en madera tornillo y base contra placado en triplay de 4 mm. Acabado en laca brillante a la piroxilina color natural, cancha de vidrio cristal triple de 6mm pintado color verde (dise&ntilde;o de gras con sticker de Universitario de Deportes y Alianza Lima), varillas de fierro zincados de 5/8&rdquo; x 1.5 mm de pared, jugadores pintados con uniforme de su respectivo equipo, incluye 12 bolas de fulbito, 50 fichas.</p>', NULL, '975.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-11-07 12:10:00', NULL, NULL, NULL, NULL),
(41, 'Fulbito comercial', 'fulbito-comercial', '<p>Medidas 1.40m x 0.73cm confeccionado en madera tornillo y base contra placado en triplay de 4mm. Acabado en laca brillante a la piroxilina color natural, cancha de vidrio cristal triple de 6mm pintado color verde (dise&ntilde;o de gras con sticker de Universitario de Deportes y Alianza Lima), varillas de fierro zincados de 5/8&rdquo; x 1.5mm de pared, jugadores pintados con uniforme de su respectivo equipo, incluye 12 bolas de fulbito, 50 fichas, 2 mangos, 2 jugadores</p>', NULL, '850.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(42, 'Fulbito comercial en formica', 'fulbito-comercial-en-formica', '<p>Accionado con fichas (traga fichas), confeccionado en aglomerado de pino (placa masisa), enchapado en formica post-formable color al escoger, la base es de metal pintado con pintura al horno,  cancha de vidrio cristal triple de 6mm pintado color verde (dise&ntilde;o de gras con sticker de Universitario &ndash; Alianza Lima o el equipo que desee), varillas de tubo zincados de ⅝&rdquo; x 1.5mm de pared gruesa, jugadores pintados con uniforme de su respectivo equipo, se le entrega con  50 fichas ,1 jugador, 2 manija y 12 bolas.</p>', NULL, '1100.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-10-18 14:43:54', NULL, NULL, NULL, NULL),
(43, 'Fulbito comercial con base de metal', 'fulbito-comercial-con-base-de-metal', '<p>Confeccionado en madera tornillo y la base es de metal (pintado con pintura al horno), cancha de vidrio cristal triple de 6mm, pintado color verde, varillas de tubo zincados de 5/8&rdquo; x 1.5mm, pared gruesa, jugadores pintados con uniforme de su respectivo equipo, se le entrega con 50 fichas y 12 bolas.</p>', '', '950.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(44, 'Fulbito familiar enchapado en formica posformable', 'fulbito-familiar-enchapado-en-formica-posformable', '<p>Confeccionado en aglomerado de pino (placa masisa), enchapado en formica post-formable color al escoger, la base es de metal pintado con pintura al horno,  cancha de vidrio cristal triple de 6mm pintado color verde (dise&ntilde;o de gras con sticker de Universitario &ndash; Alianza Lima, varillas de tubo zincados de ⅝&rdquo; x 1.5mm de pared gruesa, jugadores pintados con uniforme de su respectivo equipo, se le entrega con   ,1 jugador, 2 manija y 12 bolas.</p>', NULL, '750.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-01-06 12:06:01', NULL, NULL, NULL, NULL),
(45, 'Fulbito familiar', 'fulbito-familiar', '<p>Medidas 1.40m x 0.73cm confeccionado en madera tornillo y base contra placado en triplay de 4mm. Acabado en laca brillante a la piroxilina color natural, cancha de vidrio cristal triple de 6mm pintado color verde (dise&ntilde;o de gras con sticker de Universitario de Deportes y Alianza Lima), varillas de fierro zincados de ⅝&rdquo; x 1.5mm de pared, jugadores pintados con uniforme de su respectivo equipo, incluye 12 bolas de fulbito.</p>', NULL, '550.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(46, 'Rueda de Chicago (16 cabinas)', 'rueda-de-chicago-(16-cabinas)', '<p>Medidas altura de 16.2m. , ancho de base 12m.y largo de base 11m. Estructura confeccionada en metal (&aacute;ngulos, rieles y tubos). Estructuras met&aacute;licas  desarmables y pintadas. (Base zincromato y colores en gloss acr&iacute;lico).  Consta de 16 cabinas de 1.50m. de altura x 1.25m. de ancho en fibra de vidrio pintadas con esmalte al horno, con ventanas  recubiertas en acr&iacute;lico transparente y puerta met&aacute;lica.  Un motor trif&aacute;sico de 6hp x 220v.</p>', NULL, '138600.00', NULL, NULL, NULL, NULL, 0, 0, 0, '2011-09-30', '2012-05-04 22:17:48', NULL, NULL, NULL, NULL),
(47, 'Rueda de chicago (05 cabinas)', 'rueda-de-chicago-(05-cabinas)', '<p>Estructura confeccionada en metal (&aacute;ngulos, rieles y tubos) consta de 5 cabinas de fibra de vidrio con capacidad para 04 personas en cada cabina, total en el juego ingresan  (20 pasajeros entre ni&ntilde;os y adultos). Pintado totalmente con pintura al horno en colores variados incluye: motor el&eacute;ctrico y sistema el&eacute;ctrico (apagado y encendido), altura del juego es de 5m.</p>', NULL, '35200.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(48, 'Mundo infantil', 'mundo-infantil', '<p>Confeccionado en tubo negro estructural de &frac34;&rdquo; x 2mm base confeccionado en tubo estructural de 1&rdquo; x 2mm pintado con esmalte al horno en 4 colores diferentes, asientos y espaldar acolchado con espuma de 2&rdquo; y forrado con carpa lona concord, el techo confeccionado en  carpa lona de colores, con capacidad para 12 ni&ntilde;os debidamente sentados.</p>', NULL, '2530.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(49, 'Mundo infantil parque', 'mundo-infantil-parque', '<p>Confeccionado en tubo negro estructural de &frac34;&rdquo; x 2mm base confeccionado en tubo estructural de 1&rdquo; x 2mm pintado con esmalte al horno en 4 colores diferentes, el techo confeccionado en  carpa lona de colores, asientos y piso de madera huairuro y espaldar de tubo con capacidad para 12 ni&ntilde;os debidamente sentados. Con un eje de 6.5  cm. de di&aacute;metro con dos rodajes (uno c&oacute;nico y normal), m&aacute;s resistente considerando su uso p&uacute;blico.</p>', NULL, '2860.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-01-06 12:29:39', NULL, NULL, NULL, NULL),
(50, 'Trompo giratorio con sombrilla', 'trompo-giratorio-con-sombrilla', '<p>De 1.50m de di&aacute;metro, confeccionado en tubo negro de  &frac34;&rdquo;  x 2mm pintado con esmalte al horno en diferentes colores o al escoger, asientos y respaldar acolchados con espuma de 2&rdquo; y forrado en carpa lona en 4 colores (amarillo, rojo, verde y azul), la sombrilla forrada con lino plastificado en 4 colores, con capacidad para 8 ni&ntilde;os debidamente sentados.</p>', NULL, '1430.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-12-06 16:46:05', NULL, NULL, NULL, NULL),
(51, 'Trompo giratorio', 'trompo-giratorio', '<p>De 1.50m de di&aacute;metro, confeccionado en tubo negro de  &frac34;&rdquo;  x 2mm  pintado con esmalte al horno en diferentes colores o al escoger, asientos de madera huayruro, con capacidad para 8 &ndash; 10 ni&ntilde;os debidamente sentados.</p>', NULL, '1500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(52, 'Carrusel de caballitos', 'carrusel-de-caballitos', '<p>Medida de 2m de di&aacute;metro, confeccionado en tubo negro de diferentes medidas (1&frac14;&rdquo;, 1&rdquo;, &frac34;&rdquo;) x 2mm pintado con esmalte al horno color aluminio o al escoger, el piso es de madera huayruro acabado con laca brillante a la piroxilina, consta de 4 caballitos de fibra de vidrio pintados con hielco de diferentes colores y laqueados con esmalte transparente al horno. La sombrilla esta confeccionada en tubo negro de &frac34;&rdquo; x 2mm pintado con esmalte al horno y forrado con carpa lona en 4 colores diferentes (amarillo, verde, rojo y azul).</p>', NULL, '5500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(53, 'Carrusel de animalitos', 'carrusel-de-animalitos', '<p>Medida de 2m de di&aacute;metro, confeccionado en tubo negro de diferentes medidas (1&frac14;&rdquo;, 1&rdquo;, &frac34;&rdquo;) x 2mm pintado con esmalte al horno color aluminio o al escoger, el piso es de madera huayruro acabado con laca brillante a la piroxilina, consta de 4 animalitos de fibra de vidrio pintados con hielco de diferentes colores y laqueados con esmalte transparente al horno. La sombrilla esta confeccionada en tubo negro de &frac34;&rdquo; x 2mm pintado con esmalte al horno y forrado con carpa lona en 4 colores diferentes (amarillo, verde, rojo y azul).</p>', NULL, '5500.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-01-06 12:30:25', NULL, NULL, NULL, NULL),
(54, 'Carrusel solo', 'carrusel-solo', '<p>Medida de 4.27.m de di&aacute;metro, confeccionado en tubo negro de diferentes medidas pintado con esmalte al horno color aluminio o al escoger, el piso es de madera acabado con laca brillante a la piroxilina, La sombrilla esta confeccionada en tubo negro pintado con esmalte al horno y forrado con carpa lona en 4 colores diferentes.</p>', NULL, '10780.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(55, 'Carrusel giratorio', 'carrusel-giratorio', '<p>Medida de 2.50m de di&aacute;metro, confeccionado en tubo negro de metal (1&frac14;&rdquo;, 1&rdquo;, x 2mm) pintado con esmalte al horno color aluminio o al escoger, el piso es de madera huairuro machihembrado  acabado en barniz marino, barandas de seguridad pintado en esmalte al horno color rojo (tubo negro de 1&rdquo; x 2mm), Con un eje de 6.5  cm. de di&aacute;metro con dos rodajes (uno c&oacute;nico y normal), el sistema giratorio es de impulso mec&aacute;nico manual.</p>', NULL, '3080.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-11-07 12:11:54', NULL, NULL, NULL, NULL),
(56, 'Animalitos en fibra de vidrio', 'animalitos-en-fibra-de-vidrio', '<p>Animalitos en fibra de vidrio</p>', NULL, '880.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-11-07 12:10:54', NULL, NULL, NULL, NULL),
(57, 'Casita grap kids', 'casita-grap-kids', '<p>Medidas 1.20m x 1.20m, elaborado en placa masisa y enchapado en formica postformable en colores variados.</p>', NULL, '1595.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-05-04 22:10:04', NULL, NULL, NULL, NULL),
(58, 'Casita con bancas', 'casita-con-bancas', '<p>Confeccionado en aglomerado (placa masisa de 18mm) pintado en colores, estructura de piso  en madera huayruro  laqueado color natural o pintado en esmalte Gloss, techo a dos aguas y dos bancas.</p>\r\n<p><strong>Medidas:</strong> <br /> Largo : 2.80 m<br /> Ancho : 1.20 m<br /> Altura : 2.20 m</p>', NULL, '4670.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(59, 'Casita sola', 'casita-sola', '<p>Confeccionado en aglomerado (placa masisa de 18mm) pintado en colores, estructura  en madera huayruro de 3&rdquo; x 3&rdquo;  laqueado color natural, techo a dos aguas y dos bancas.</p>\r\n<p><strong>Medidas :</strong><br /> Largo : 1.20m <br /> Ancho : 1.20m <br /> Altura : 2.20m</p>', NULL, '1716.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(60, 'Casita con tobogan', 'casita-con-tobogan', '<p>Confeccionado totalmente  en madera huayruro de 3&rdquo; x 3&rdquo;  laqueado color natural, techo a dos aguas, pared lateral con palestras de fibra de vidrio de colores, con  terraza, puerta  y ventana.</p>\r\n<p><strong>JUEGOS QUE INCLUYE :</strong> <br /> 01 TOBOGAN DE FIBRA DE VIDRIO DE 1M <br /> 01 ESCALERA DE MADERA</p>\r\n<p><strong>MEDIDAS :</strong> <br /> Largo: 2.0 m <br /> Ancho: 1.80 m <br /> Altura: 2.80m</p>', NULL, '5216.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(61, 'Balancin doble', 'balancin-doble', '<p>Confeccionado en madera huayruro laqueado en color natural, base y agarraderas confeccionados en tubo negro estructural (&frac34;&rdquo; x 2mm) pintado con esmalte al horno en colores, plataformas de resortes de &aacute;ngulos de 1&frac12;&rdquo; resortes de ⅝&rdquo;  de espesor pintado en esmalte al horno en colores y canales &ldquo;U&rdquo; de 2&rdquo; x 3&rdquo; x ⅛&rdquo; pintado en esmalte al horno en colores.</p>\r\n<p><strong>Medidas :</strong> <br /> Marco de base : 1.m x 1.m metal. <br /> Marco de agarraderas : 0.65cm x 0.55cm. <br /> Base de resorte : 1 &frac12;&rdquo; x 8&rdquo; madera. <br /> Estructura de asientos : 3&rdquo; x 3&rdquo; x 1.10m madera.</p>', NULL, '1450.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-01-06 12:32:23', NULL, NULL, NULL, NULL),
(62, 'Caballito (4 resortes)', 'caballito-(4-resortes)', '<p>Confeccionado en fibra de vidrio (2 capas), accionado en cuatro resortes de alta tensi&oacute;n, pintado en esmalte al horno en colores variados, su estructura es de tubo cuadrado de 1&rdquo; x 1.5&rdquo;, tambi&eacute;n pintado en esmalte al horno colores variados.</p>', NULL, '790.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(63, 'Balancin personal', 'balancin-personal', '<p>Figuras confeccionadas en madera huayruro de 1&rdquo; &frac14; espesor, acabado en laca brillante y estructura pintado con un esmalte al horno, base de resorte de suspensi&oacute;n con anclaje de tubo negro de &frac34; x 2.00.</p>', NULL, '1100.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-05-04 22:15:21', NULL, NULL, NULL, NULL),
(64, 'Balancin fibra de vidrio', 'balancin-fibra-de-vidrio', '<p>Confeccionado en fibra de vidrio de alta resistencia  de 26 Kg., con base de resorte de suspensi&oacute;n con anclaje de tubo negro de &frac34;  x 2.</p>', NULL, '1600.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(65, 'Mecedora', 'mecedora', '<p>Confeccionado en tubo cuadrado de 7/8 x 1.5mm pintado con anticorrosivo y esmalte al horno en colores al escoger, asientos y respaldar en madera huairuro barnizado.</p>', NULL, '600.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-01-06 12:29:56', NULL, NULL, NULL, NULL),
(66, 'Piscina de Pelotas Baby', 'piscina-de-pelotas-baby', '<p>Medidas de 1.50m x 2m x 1.80m, confeccionadas en tubo negro de 1&frac14;&rdquo; x 2mm pintado en esmalte al horno color aluminio y acolchado con espuma de 2&rdquo; de espesor y forrado con carpa lona en 4 colores (amarillo, rojo, verde y azul) asimismo el techo. La tina es de carpa lona con canastilla de correas de nylon debidamente cocido con hilo nylon, templada con resortes de 18cm. La piscina esta cercada con malla de nylon color verde para su mayor resistencia, el ingreso es circular acolchado y forrado, incluye una escalera de metal con paso de madera, 6 porta zapateras y 750 PELOTAS.</p>', NULL, '3135.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-10-18 14:49:14', NULL, NULL, NULL, NULL),
(67, 'Piscina de Pelotas Mixto A', 'piscina-de-pelotas-mixto-a', '<p>Medidas 3.m x 3.m x 2.50m La piscina es de 1.50m x 2.m x 1.80m, confeccionado en tubo negro de 1&frac14;&rdquo; x 2mm pintado en esmalte al horno color aluminio y acolchado con espuma de 2&rdquo; de espesor y forrado con carpa lona en 4 colores (amarillo, rojo, verde y azul) asimismo el techo. La tina es de carpa lona con canastilla de correas de nylon debidamente cocido con hilo nylon, templada con resortes de 18cm. La piscina esta cercada con malla de nylon color verde para su mayor resistencia, el ingreso es circular acolchado y forrado, incluye una escalera de metal con paso de madera, 6 porta zapateras y mil PELOTAS.</p>', NULL, '14300.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-11-07 12:07:14', NULL, NULL, NULL, NULL),
(68, 'Tobogan Inflable Muñecos', 'tobogan-inflable-munecos', '<p>Confeccionado en tela importada de colores, tiene las siguientes caracter&iacute;sticas medidas 4.40m ancho, 10.m largo y 8.m de altura, una escalera intermedio y dos resbalones lateral con tres arcos en la parte delantera adornados con mu&ntilde;ecos, en la parte posterior un techo parcial sobre los resbalones y escaleras con respaldar, motor soplador de dos caballos de fuerza.</p>', NULL, '33000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(69, 'Tobogan Inflable Palmeras', 'tobogan-inflable-palmeras', '<p>Confeccionado en tela importada de colores, tiene las siguientes caracter&iacute;sticas medidas 3.80m ancho, 8.m largo y 7.m de altura, una escalera intermedio y dos resbalones laterales con palmeras de adorno, un techo parcial en la parte superior de la escalera y resbalones, motor soplador de dos caballos de fuerza de alta velocidad.</p>', NULL, '27500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(70, 'Tobogan Inflable Payaso', 'tobogan-inflable-payaso', '<p>Confeccionado en tela importada de colores, tiene las siguientes caracter&iacute;sticas medidas 3.80m ancho, 8.m largo y 7.m de altura, una escalera intermedio y dos resbalones laterales, un techo parcial con adorno de payaso en la parte superior de la escalera y resbalones, motor soplador de dos caballos de fuerza de alta velocidad.</p>', NULL, '29700.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(71, 'Tobogan Inflable Olas', 'tobogan-inflable-olas', '<p>Confeccionado en tela importada de colores, tiene las siguientes caracter&iacute;sticas medidas 3.80m ancho, 8.m largo y 7.m de altura, una escalera intermedio y dos resbalones laterales, un techo parcial con 02 adornos de delfines  en la parte superior de la escalera y resbalones, motor soplador de dos caballos de fuerza de alta velocidad</p>', NULL, '30800.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(72, 'Tobogan Inflable Grap Kids', 'tobogan-inflable-grap-kids', '<p>Confeccionado en material importado en colores (rojo, amarillo, verde y azul, morado, blanco y fucsia), tiene las siguientes caracter&iacute;sticas medidas 3.80m ancho, 8.m largo y 7.m de altura, una escalera intermedio y dos resbalones laterales, un techo parcial en la parte superior de la escalera y resbalones, motor soplador de dos caballos de fuerza de alta velocidad.</p>', NULL, '25300.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(73, 'Tobogan Inflable Robot', 'tobogan-inflable-robot', '<p>Confeccionado en tela importada de colores, 5m. de ancho, 8.20.m largo y 7.m de altura, una escalera intermedio y dos resbalones laterales, se le entrega con un motor soplador de dos caballos de fuerza.</p>', NULL, '46200.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
