(79, 'CDP modelo minnie mouse', 'cdp-modelo-minnie-mouse', '<p>Confeccionado en fibra de vidrio pintado con esmalte al horno con un di&aacute;metro de 0.60cm.</p>', NULL, '352.00', NULL, NULL, NULL, NULL, 0, NULL, 2, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(80, 'Tobogán Barco', 'tobogan-barco', '<p>Confeccionado en fibra de vidrio contra-placado de 4mm de espesor, pintado al horno, estructura de metal (tubo negro de 1 &frac12;&rdquo;, 1&rdquo; x &frac34; x 2mm), pintado al horno color aluminio y 2.90mt de altura.</p>', NULL, '0.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(81, 'Tobogán Tubular con Cabeza de Dragón', 'tobogan-tubular-con-cabeza-de-dragon', '<p>Confeccionado en fibra de vidrio contra placado de 720mm de di&aacute;metro y 4mm de espesor, pintado con hielco de color a escoger,  estructura de metal pintado al horno, (Tubo negro de 1&frac14;&rdquo; x 2.0mm anclado al terreno con concreto) este tobog&aacute;n de desplaza de una altura de 5mts y se desliza en forma de SIG SAG en  un largo de 10mts, tambi&eacute;n lleva ventanas a ambos lados a lo largo del deslizamiento y la salida tiene una cabeza de DRAGON como aparece en la fotograf&iacute;a que  mostramos.</p>', NULL, '26400.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-12-06 17:06:09', NULL, NULL, NULL, NULL),
(82, 'Tobogán Tubular Caracol con Cabeza de Serpiente', 'tobogan-tubular-caracol-con-cabeza-de-serpiente', '<p>Confeccionado en fibra de vidrio contra-placado de 4mm de espesor, pintado al horno tipo serpiente, estructura de metal (tubo negro de 1 &frac12;&rdquo;, 1&rdquo; x &frac34; x 2mm), pintado al horno color aluminio y 2.90mt de altura.</p>', NULL, '16500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(83, 'Tobogán Tubular', 'tobogan-tubular', '<p>Confeccionado en fibra de vidrio contra placado de 720mm.de di&aacute;metro y 4mm de espesor, pintado con esmalte al horno de 4 colores, altura de 2.m.</p>', NULL, '3300.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(84, 'Tobogán Caracol', 'tobogan-caracol', '<p>Confeccionado en fibra de vidrio 4mm de espesor, pintado con hielco de color amarillo, la  estructura  es de metal  (tubo negro estructural de 1&frac14;&rdquo;,  x 2mm) pintado al horno color aluminio.</p>', NULL, '4950.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(85, 'Tobogán Tubular Caracol', 'tobogan-tubular-caracol', '<p>Confeccionado en fibra de vidrio contra placado de 720mm de di&aacute;metro y 4mm.de espesor, pintado con hielco de 4 colores, estructura de metal pintado al horno, acolchado con espuma de 2&rdquo; y forrado con lona plastificada en cuatro colores, tambi&eacute;n incluye escalera triangular de metal con techo y cubo de fibra de vidrio con ventanas circulares cubiertas con c&uacute;pulas de acr&iacute;lico.</p>', NULL, '9130.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(86, 'Tobogán Ondeado 2 M de Alt.', 'tobogan-ondeado-2-m-de-alt', '<p>Elaborado en fibra de vidrio de 4mm de espesor y pintados con resina hielco en colores, su escalera esta confeccionada en tubo redondo. Pintado con esmalte al horno de color, el modelo es ondeado.</p>\r\n<p><strong>MEDIDAS :</strong><br /> ALTURA : 2 M <br /> LARGO : 3.50 M <br /> ANCHO : 0.46 CM</p>', NULL, '1550.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(87, 'Tobogán Ondeado 1.50 M de Alt', 'tobogan-ondeado-150-m-de-alt', '<p>Elaborado en fibra de vidrio de 4mm de espesor y pintados con resina hielco en  colores al escoger, su escalera esta confeccionada en tubo cuadrado de ⅞&rdquo; x 1.5mm pintado con anticorrosivo y esmalte  al horno en colores al escoger.</p>\r\n<p><strong>MEDIDAS :</strong><br /> ALTURA : 1.50 M <br /> LARGO : 2.50 M <br /> ANCHO : 0.46 CM</p>', NULL, '880.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(88, 'Tobogán Ondeado 1.50 M de Alt EE', 'tobogan-ondeado-150-m-de-alt-ee', '<p>Togog&aacute;n Ondeado Edici&oacute;n Especial, elaborado en fibra de vidrio de 4mm de espesor y pintados con resina hielco en  colores al escoger, su escalera esta confeccionada en tubo cuadrado de ⅞&rdquo; x 1.5mm pintado con anticorrosivo y esmalte  al horno.</p>\r\n<p><strong>MEDIDAS :</strong><br /> ALTURA : 1.50 M<br /> LARGO : 2.50 M<br /> ANCHO : 0.46 CM</p>', NULL, '990.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-10-15 11:25:42', NULL, NULL, NULL, NULL),
(89, 'Tobogán Ondeado 1.20 M de Alt', 'tobogan-ondeado-120-m-de-alt', '<p>Elaborado en fibra de vidrio de 4mm de espesor y pintados con resina hielco en colores, su escalera esta confeccionada en tubo cuadrado, Pintado con esmalte  al horno de color el modelo es ondeado.</p>\r\n<p><strong>MEDIDAS :</strong><br /> ALTURA : 1.20 M <br /> LARGO : 2.50 M <br /> ANCHO : 0.46 CM</p>', NULL, '770.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(90, 'Tobogán Ondeado 1 M de Alt', 'tobogan-ondeado-1-m-de-alt', '<p>Elaborado en fibra de vidrio de 4mm de espesor y pintados con resina hielco en colores, su escalera esta confeccionada en tubo cuadrado. Pintado con esmalte al horno de color, el modelo es ondeado.</p>\r\n<p><strong>MEDIDAS :</strong> <br /> ALTURA : 1 M <br /> LARGO : 1.80 M <br /> ANCHO : 0.42 CM</p>', NULL, '550.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(91, 'Tobogán Ondeado 0.70 CM de Alt', 'tobogan-ondeado-070-cm-de-alt', '<p>Elaborado en fibra de vidrio de 4mm de espesor y pintados con resina hielco en colores, su escalera esta confeccionada en tubo cuadrado. Pintado con esmalte al horno de color, el modelo es ondeado.</p>\r\n<p><strong>MEDIDAS :</strong> <br /> ALTURA : 0.70 CM <br /> LARGO : 1.35 M <br /> ANCHO : 0.42 CM</p>', NULL, '440.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(92, 'Tobogán Arcoíris', 'tobogan-arcoiris', '<p>Confeccionado en fibra de vidrio de 4mm de espesor pintado en colores variados con una altura de 0.96cm y ancho de 0.65cm, con escalera incorporada de fibra de vidrio, tambi&eacute;n se puede usar en piscina.</p>', NULL, '1870.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-10-18 14:43:13', NULL, NULL, NULL, NULL),
(93, 'Tobogan Mellizo 1.50 M de Alt', 'tobogan-mellizo-150-m-de-alt', '<p>Elaborado en fibra de vidrio de 4mm de espesor y pintados con resina hielco en  colores al escoger, su escalera esta confeccionada en tubo cuadrado de ⅞&rdquo; x 1.5mm pintado con anticorrosivo y esmalte  al horno en colores al escoger.</p>', NULL, '1750.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-01-06 12:33:21', NULL, NULL, NULL, NULL),
(94, 'Tobogán Doble', 'tobogan-doble', '<p>Elaborado en fibra de vidrio de 4mm de espesor y pintados con resina hielco en  colores al escoger, su escalera esta confeccionada en tubo negro de 1&rdquo; x 2.0mm x  3/4 x 2.0mm pintado con anticorrosivo y esmalte  al horno en colores al escoger.</p>', NULL, '2310.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-10-18 14:43:25', NULL, NULL, NULL, NULL),
(95, 'Mesa Cuadrada', 'mesa-cuadrada', '<p>Mesa de 60cm x 60cm confeccionado en tubo cuadrado de ⅞&rdquo; pintado en esmalte al horno en colores al escoger, tablero confeccionado en placa aglomerado de pino enchapado en formica post-forming en colores variados.</p>', NULL, '198.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(96, 'Mesa Rectangular', 'mesa-rectangular', '<p>Mesa de 1.20m x 60cm x 60cm. confeccionado en tubo cuadrado de ⅞&rdquo; pintado en esmalte al horno en colores al escoger, tablero confeccionado en placa aglomerado de pino enchapado en formica post-forming en colores variados.</p>', NULL, '330.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-10-18 14:44:12', NULL, NULL, NULL, NULL),
(97, 'Mesa Riñón', 'mesa-rinon', '<p>Mesa de 1.80m de di&aacute;metro exterior x 70cm di&aacute;metro interior confeccionado en tubo cuadrado de ⅞&rdquo; pintado en esmalte al horno en colores al escoger, tablero confeccionado en placa aglomerado de pino enchapado en formica  en colores variados.</p>', NULL, '660.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-12-06 17:03:21', NULL, NULL, NULL, NULL),
(98, 'Mesa Redonda', 'mesa-redonda', '<p>MESA REDONDA DE  1.20 M DE DIAMETRO.</p>\r\n<p>Confeccionado  con estructuras de metal y tablero de melamine de 18mm.</p>', NULL, '660.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(99, 'Carpeta Doble A', 'carpeta-doble-a', '<p>Confeccionado en tubo cuadrado de ⅞&rdquo; pintado en esmalte al horno en colores al escoger, respaldar y sentadera confeccionado en placa masisa (aglomerado de pino) enchapado en formica post-forming en colores variados.</p>', NULL, '0.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(100, 'Carpeta Doble B', 'carpeta-doble-b', '<p>Carpeta Doble B</p>', NULL, '0.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(101, 'Deslizador Aéreo Cableado 15 M', 'deslizador-aereo-cableado-15-m', '<p>Estructura de madera Huayruro laqueado y barnizado (barniz marino) en forma triangular con plataforma de 1.m x 1.80m arco de madera huayruro. Anclados al piso a 0.40cm de profundidad con vaciado de cemento y protegido con un dercoating.</p>', '<iframe width="560" height="315" src="http://www.youtube.com/embed/PQkx5R_HStY?rel=0" frameborder="0" allowfullscreen></iframe>', '3520.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-10-18 14:50:08', NULL, NULL, NULL, NULL),
(102, 'Deslizador de Metal', 'deslizador-de-metal', '<p>Confeccionado En tubo negro de 2&rdquo; x 2mm, &frac34;  x 2mm y dos rieles stanley pintado en esmalte al horno en colores variados. Estructura anclado al piso con concreto armado.</p>', NULL, '2000.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-11-07 12:06:27', NULL, NULL, NULL, NULL),
(103, 'Climbing Hexagonal', 'climbing-hexagonal', '<p>Confeccionado de madera huayruro, laqueado y barnizado con barniz marino color natural, dise&ntilde;ado para ni&ntilde;os: 3-12 a&ntilde;os incluye tablero vertical con palestras de fibra de vidrio, escalera de sogas con pasos de madera, trepados de sogas, dos tubos de bomberos, altura de juegos es de  1.80mts.</p>', NULL, '2300.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-05-04 22:21:43', NULL, NULL, NULL, NULL),
(104, 'Trepadora Telaraña', 'trepadora-telarana', '<p>Confeccionado en sogas de nylon de 1&rdquo; color blanco, telara&ntilde;a es una pir&aacute;mide de sogas entrelazadas anudadas para treparse y escalar, tiene una &aacute;rea de 4.50mt x 4.50mt, el poste interior tiene una altura de 5mt y es de madera huayruro (resistente a humedad y sol) o tornillo de 4&rdquo; x 4&rdquo; pulgadas de espesor con bordes redondeados superficie seca y acabados en barniz marino.</p>', NULL, '3740.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-10-18 14:50:12', NULL, NULL, NULL, NULL),
(105, 'Trepadora Rombo', 'trepadora-rombo', '<p>Confeccionado en sogas de nylon de 1&rdquo; color blanco, el astro net es un rombo de sogas entrelazadas anudadas para treparse y escalar, de 3 m. de altura y 2.50m de di&aacute;metro.</p>', NULL, '1705.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-11-07 12:05:54', NULL, NULL, NULL, NULL),
(106, 'Rampa de Sogas', 'rampa-de-sogas', '<p>Confeccionado en madera huayruro de 2m de altura x 2m acabado en laca.</p>', NULL, '1200.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(107, 'Columpio con 4 Asientos', 'columpio-con-4-asientos', '<p>Medida de 2.10m de altura x 3.80 de largo, la estructura esta confeccionado en tubo negro estructural, el travesa&ntilde;o es de 2&rdquo; x 2mm y los parantes de 1&frac12;&rdquo; x 2mm pintado con esmalte al horno, los columpios esta accionado x un sistema de rodajes (mayor durabilidad para el uso publico), asientos de madera huayruro y cadenas galvanizados de &frac14; .</p>', '', '1500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `gk_productos` (`pro_id`, `pro_nombre`, `pro_key`, `pro_descripcion`, `pro_video`, `pro_precio`, `pro_precio_oferta`, `pro_descuento`, `pro_valor_a`, `pro_valor_b`, `pro_oferta`, `pro_destacar`, `pro_estado`, `pro_fecha`, `pro_fecha_update`, `pro_description`, `pro_keywords`, `pro_analytics`, `pro_orden`) VALUES
(108, 'Columpio Cuádruple con 2 Asientos y  2 Calesas', 'columpio-cuadruple-con-2-asientos-y-2-calesas', '<p>Medida de 2.10m de altura x 3.80 de largo, la estructura esta confeccionado en tubo negro estructural, el travesa&ntilde;o es de 2&rdquo; x 2mm y los parantes de 1&frac12;&rdquo; x 2mm pintado con esmalte al horno, los columpios esta accionado x un sistema de rodajes (mayor durabilidad para el uso publico), asientos de madera huayruro  y cadenas galvanizados de 3/16,  con dos calesas confeccionados con tubo cuadrado.</p>', NULL, '2100.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(109, 'Columpio Triple Mixto Asiento Calesa Balancín', 'columpio-triple-mixto-asiento-calesa-balancin', '<p>Medida de 1.90m de altura por 2.80m de largo, la estructura esta confeccionado en tubo negro estructural, el travesa&ntilde;o es de 2&rdquo; x 2mm y los parantes de 1&frac14;&rdquo; x 2mm pintado con esmalte al horno, los columpios esta accionado por un sistema de rodajes (mayor durabilidad para el uso publico), balancines confeccionados con tubo negro estructural de &frac34; x 2mm y asientos de fibra de vidrio y cadenas galvanizados de 3/16, calesas confeccionados con tubo cuadrado y asientos de Fibra de Vidrio.</p>', NULL, '1300.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-05', '2011-10-15 11:25:02', NULL, NULL, NULL, NULL),
(110, 'Pasamanos Circular', 'pasamanos-circular', '<p>Confeccionado en tubo negro de 2 &ldquo;,1 &frac12;&rdquo; x 2.0mm y &frac34;&rdquo; x 2mm pintado en esmalte gloss de colores tiene una altura de 2.m x 2.m de di&aacute;metro y 3.20 m de largo, anclado a 0.50m de profundidad.</p>', NULL, '1850.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-05', '2012-01-06 12:34:06', NULL, NULL, NULL, NULL),
(111, 'Pasamanos Culebra', 'pasamanos-culebra', '<p>Confeccionado en tubo negro de 2&rdquo; x 2.5mm y &frac34;&rdquo; x 2mm pintado en esmalte gloss de colores tiene una altura de 2.m 2.75m de largo.</p>', NULL, '1200.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-05', '2012-01-06 12:33:48', NULL, NULL, NULL, NULL),
(112, 'Pasamanos Ola', 'pasamanos-ola', '<p>Confeccionado en tubo negro, escalera de 1 &frac12; &rdquo; x 2mm, curva de pasamanos de  &frac34;&rdquo; x 2mm pintado en esmalte gloss de colores tiene una altura de 2.10.m, el ancho es de 0.60cm y 4.00m de largo.</p>', NULL, '2200.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(113, 'Pasamanos Curvo', 'pasamanos-curvo', '<p>Confeccionado en tubo negro, escalera de 2'''' x 2mm,  curva de pasamanos de 1&frac12;'''' x 2mm x 2m de altura  y argollas triangulares de &frac34; x 2mm pintado en gloss con colores a escoger.</p>', NULL, '825.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(114, 'Pasamanos S', 'pasamanos-s', '<p>Confeccionado en tubo negro, escalera de 2&rdquo; x 2mm, curva de pasamanos de 1 1/2&rdquo; x 2.mm y argollas de &frac34;&rdquo; x 2mm pintado en esmalte gloss de colores tiene una altura de 2.m y 2.75m de largo.</p>', NULL, '1500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(115, 'Pasamanos Cruz', 'pasamanos-cruz', '<p>Pasamanos Cruz</p>', NULL, '1800.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(116, 'Pasamanos 2 Circulos', 'pasamanos-2-circulos', '<p>Pasamanos 2 Circulos</p>', NULL, '0.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(117, 'Circuito de Pasamanos A', 'circuito-de-pasamanos-a', '<p>Medidas de 7.m x 5.m la estructura esta confeccionad en tubo negro estructural de 1&frac12;&rdquo; x 1&frac34;&rdquo;.</p>', NULL, '5222.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(118, 'Circuito de Pasamanos B', 'circuito-de-pasamanos-b', '<p>Medidas de 7.m x 5.m la estructura esta confeccionad en tubo negro estructural de 1&frac12;&rdquo; x 1&frac34;&rdquo;.</p>', NULL, '0.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(119, 'Pasamanos de Madera', 'pasamanos-de-madera', '<p>Confeccionado en madera huayruro con parantes de 3 x 3 con tubo de &frac34;  tiene una altura de 1.80.m  por 2.70m de largo y 0.60m. de ancho.</p>', NULL, '1500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(120, 'Sube y Baja de Madera', 'sube-y-baja-de-madera', '<p>Confeccionado en madera huayruro con asientos butaca de fibra de vidrio pintado en esmalte al horno en colores con correa de seguridad, el travesa&ntilde;o  es de 6mt el largo,  con ejes de 3.20m de largo C/U,  altura de 50cm.</p>', NULL, '3400.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(121, 'Sube y Baja de Metal', 'sube-y-baja-de-metal', '<p>Confeccionado en tubo negro estructural de 2 1/2&rdquo; x  3mm y 2&rdquo; x 2mm y 0.50cm de  altura con ejes de 3.20m de largo con asientos de fibra de vidrio pintado en esmalte al horno en colores.</p>', NULL, '2100.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-05', '2011-12-06 16:40:38', NULL, NULL, NULL, NULL),
(122, 'Cama Elastica Rectangular 10M x 5M (Techo Piramide)', 'cama-elastica-rectangular-10m-x-5m-(techo-piramide)', '<p>Medida de 10.60m x 5.30m confeccionado en tubo negro de 1&frac12;'''' y 1&frac14;'''' x 2mm pintado en esmalte al horno color aluminio con estructura desarmable, con lona importada, 240 resortes de 8&frac12;'''' de largo, 14 postes y protector de resortes confeccionado de carpa lona en 2 colores, acolchado con espuma de 1'''', cocido con hilo nylon, parantes confeccionados en tubo de metal totalmente desarmable pintado en esmalte al horno color aluminio, y acolchado con espuma de 2'''', techo y parantes forrados con carpa lona en 2 colores. La falda esta confeccionado en carpa lona en 2 colores.</p>', NULL, '18150.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-05', '2012-05-04 22:07:35', NULL, NULL, NULL, NULL),
(123, 'Cama Elastica Rectangular 10M x 5M', 'cama-elastica-rectangular-10m-x-5m', '<p>Medida de 10.60m x 5.30m confeccionado en tubo negro de 1&frac12;'''' y 1&frac14;'''' x 2mm pintado en esmalte al horno color aluminio con estructura desarmable, con lona importada, 240 resortes de 8&frac12;'''' de largo , 14 postes y protector de resortes confeccionado de carpa lona en 2 colores, acolchado con espuma de 1'''', cocido con hilo nylon, parantes confeccionados en tubo de metal totalmente desarmable pintado en esmalte al horno color aluminio, y acolchado con espuma de 2'''', techo y parantes forrados con carpa lona en 2 colores. La falda esta confeccionado en carpa lona en 2 colores, y falda vine decorada con figuras de animales.</p>', NULL, '18150.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
