(156, 'Set Figuras Geometricas 6 PZS', 'set-figuras-geometricas-6-pzs', '<p>Colorido y educativo, este set est&aacute; conformado por 6 figuras geom&eacute;tricas, pr&aacute;cticas y resistentes: c&iacute;rculo, cuadrado, rect&aacute;ngulo, tri&aacute;ngulo, pent&aacute;gono y oct&oacute;gono. Ense&ntilde;a los colores y las formas, y los m&aacute;s chiquititos lo pueden usar como asientos.<br />Dimensiones: Largo: 40 cm. Ancho: 40 cm. Espesor: 10 cm.<br />Colores: rojo, azul, amarillo.<br />Piezas: 6.<br />Materiales: lino plastificado lavable y espuma de alta densidad. Formas geom&eacute;tricas.</p>', NULL, '150.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
