(158, 'Colchoneta Personal', 'colchoneta-personal', '<p>Indispensables para trabajar con ni&ntilde;os y bebes, las colchonetas son &uacute;tiles para dar saltos y volantines, ejercicios abdominales, para relajaci&oacute;n y masajes a los bebes, para organizar juegos, circuitos y sobre todo para proteger de las ca&iacute;das.<br />Dimensiones: Largo: 1 m. Ancho: 50 cm. Espesor: 5 cm.<br />Color: verde.<br />Materiales: Espuma Lila (para&iacute;so zebra 400) con Lino plastificado Pesado (mejor calidad).</p>', NULL, '40.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(160, 'Playground Tacna', 'playground-tacna', '<p>Este juego se har&aacute; con arreglos tipo selva de la siguiente manera: Techos ser&aacute;n adicionados cubiertas de totora, decorado con plantas y  enredaderas artificiales de pl&aacute;stico, dos toboganes caracol modelo serpiente, y una cabeza de Le&oacute;n. Estructura del play ground confeccionado en tubo negro estructural  de 1&frac14;&rdquo; x  2mm Pintado en esmalte al horno color aluminio y acolchado con espuma de 2&rdquo; de espesor y forrado con carpa lona en 4 colores (amarillo, rojo, verde y azul). Las tinas de las piscinas es de carpa lona con canastilla de correas de nylon Debidamente cocido con hilo nylon, templada con resortes d 8&frac12;&rdquo;.</p>', NULL, '78000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-11', NULL, NULL, NULL, NULL, NULL),
(161, 'Playground Los Olivos', 'playground-los-olivos', '<p>Medidas 4.50.m x 4.m x 2.80m La piscina es de 1.50m x 2.m x 1.80m, confeccionado en tubo negro de 1&frac14;&rdquo; x 2mm pintado en esmalte al horno color aluminio y acolchado con espuma de 2&rdquo; de espesor y forrado con carpa lona en 4 colores, asimismo el techo. La tina es de carpa lona con canastilla de correas de nylon debidamente cocido con hilo nylon, templada con resortes de 18cm. La piscina esta cercada con malla de nylon color verde para su mayor resistencia, el ingreso es circular acolchado y forrado, incluye una escalera de metal con paso de madera, 6 porta zapateras y 500 pelotas.</p>', NULL, '20700.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-11', NULL, NULL, NULL, NULL, NULL),
