(171, 'Playground Doble Techo A', 'playground-doble-techo-a', '<p>Medidas de  4.50m de altura por 6m de largo y 3.60m de ancho, (Con techo). Confeccionado en tubo negro de 1&frac14;&rdquo; x 2mm pintado en esmalte al horno color aluminio en  acolchado a con espuma de 2&rdquo; de espesor y forrado con carpa lona en 4 colores (amarillo, rojo, verde y azul) asimismo el techo. La tina de piscina es de carpa lona con canastilla de correas de nylon en cual es debidamente cocido con hilo nylon, templada con resortes de 18cm. El juego esta cercado con una malla de nylon color verde para su mayor resistencia, el ingreso a la piscina es circular acolchado y forrado, incluye una escalera de metal con paso de madera, 6 porta zapateras y 2,000 pelotas.</p>', NULL, '35200.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-13', NULL, NULL, NULL, NULL, NULL),
(172, 'Playground Doble Techo B', 'playground-doble-techo-b', '<p>Playground Doble Techo M-B</p>', NULL, '0.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-13', NULL, NULL, NULL, NULL, NULL),
(173, 'Tobogán Mixto Kamikaze y Caracol A', 'tobogan-mixto-kamikaze-y-caracol-a', '<p><strong>Un tobog&aacute;n de piscina caracol de 720&ordm;:</strong> confeccionado en fibra de vidrio 4mm de espesor, pintado con hielco de color celeste, estructuras de escalera y tobog&aacute;n esta elaborado en metal (tubo negro estructural de 4'''', 2'''', 1&frac12;'''', 1'''', &frac34;'''' x 2mm) pintado con pintura ep&oacute;xica color azul, pasos de escalera, piso y techo de fibra de vidrio color celeste, lubricador de agua instalado, el circuito tiene de largo 22m, de altura 5m, de di&aacute;metro exterior 3m, el canal del circuito mide 0.65 de ancho y 0.55m de altura.</p>\r\n<p><strong>Un tobog&aacute;n de piscina kamikaze:</strong> confeccionado en fibra de vidrio de 4mm de espesor, pintado con hielco de color celeste, instalado en estructura de escalera de tobog&aacute;n caracol de 720&ordm;, estructura de soportes de tobog&aacute;n confeccionado en tubo rectangular y tubo negro estructural de 1&frac14;'''', &frac34;'''' x 2mm, pintado con pintura ep&oacute;xica en color azul, lubricador de agua instalado, el circuito tiene de largo 10m, de altura 5m, el canal del circuito mide 0.65m de ancho y 0.55m de altura.</p>', NULL, '73000.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-13', '2012-08-14 11:32:24', NULL, NULL, NULL, NULL),
(174, 'Tobogán Mixto Kamikaze y Caracol B', 'tobogan-mixto-kamikaze-y-caracol-b', '<p><strong>Un tobog&aacute;n de piscina caracol de 720&ordm;:</strong> confeccionado en fibra de vidrio 4mm de espesor, pintado con hielco de color celeste, estructuras de escalera y tobog&aacute;n esta elaborado en metal (tubo negro estructural de 4'''', 2'''', 1&frac12;'''', 1'''', &frac34;'''' x 2mm) pintado con pintura ep&oacute;xica color azul, pasos de escalera, piso y techo de fibra de vidrio color celeste, lubricador de agua instalado, el circuito tiene de largo 22m, de altura 5m, de di&aacute;metro exterior 3m, el canal del circuito mide 1m de ancho y 0.65m de altura.</p>\r\n<p><strong>Un tobog&aacute;n de piscina kamikaze:</strong> confeccionado en fibra de vidrio de 4mm de espesor, pintado con hielco de color celeste, instalado en estructura de escalera de tobog&aacute;n caracol de 720&ordm;, estructura de soportes de tobog&aacute;n confeccionado en tubo rectangular y tubo negro estructural de 1&frac14;'''', &frac34;'''' x 2mm, pintado con pintura ep&oacute;xica en color azul, lubricador de agua instalado, el circuito tiene de largo 10m, de altura 5m, el canal del circuito mide 1m de ancho y 0.65m de altura.</p>', NULL, '85000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-13', NULL, NULL, NULL, NULL, NULL),
(175, 'Tobogán Caracol Abierto 3.20 M. Altura', 'tobogan-caracol-abierto-320-m-altura', '<p>Confeccionado en Fibra de vidrio de 4mm de espesor pintado en hielco color celeste, estructura de metal (tubo negro estructural de 1 1/4&rdquo; x 2mm) pintado al horno en color azul, pasos de escalera y techo de fibra de vidrio. Tambi&eacute;n incluye lubricadores de agua totalmente instalados.</p>', NULL, '30000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-13', NULL, NULL, NULL, NULL, NULL),
(176, 'Tobogán Caracol Abierto 2.75 M. Altura', 'tobogan-caracol-abierto-275-m-altura', '<p>Confeccionado en fibra de vidrio 4mm de espesor, el ancho de la fibra es de 85cm pintado con hielco de color celeste, la  estructura  es de metal  (tubo negro estructural de 1&frac14;&rdquo;, 1&rdquo; x 2mm) pintado al horno color azul, pasos de escalera, piso, y techo de fibra de vidrio. Tambi&eacute;n incluye motobomba y lubricadores de agua totalmente instalado.</p>', NULL, '13200.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-13', NULL, NULL, NULL, NULL, NULL),
(177, 'Tobogan Sapo Acuatico', 'tobogan-sapo-acuatico', '<p>Tobog&aacute;n Sapo</p>', NULL, '6500.00', NULL, NULL, NULL, NULL, 0, 0, 0, '2011-10-13', '2012-01-04 11:53:37', NULL, NULL, NULL, NULL),
(178, 'Tobogan Pelicano Acuatico', 'tobogan-pelicano-acuatico', '<p>Tobogan Pel&iacute;cano</p>', NULL, '7500.00', NULL, NULL, NULL, NULL, 0, NULL, 0, '2011-10-13', '2012-01-13 17:32:46', NULL, NULL, NULL, NULL),
(179, 'Bote Pedalea 2 Personas', 'bote-pedalea-2-personas', '<p>Confeccionados en fibra de vidrio de 4mm de espesor pintado con hielco de colores y laqueados al horno con capacidad para 02 personas, sistema de turbina y conducci&oacute;n completamente de acero inoxidable.</p>\r\n<p>DIMENSIONES: 2.10m X 1.45m</p>', NULL, '5060.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-13', NULL, NULL, NULL, NULL, NULL),
(180, 'Bote Pedalea 4 Personas', 'bote-pedalea-4-personas', '<p>Confeccionados en fibra de vidrio de 4mm de espesor pintado con hielco de colores y laqueados al horno con capacidad para 04 personas, sistema de turbina y conducci&oacute;n completamente de acero inoxidable.</p>', NULL, '6050.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-13', NULL, NULL, NULL, NULL, NULL),
(181, 'Bote Cisne Pedalon', 'bote-cisne-pedalon', '<p>Confeccionados en fibra de vidrio de 4mm de espesor pintado con hielco de colores y laqueados al horno con capacidad para dos personas, en forma de cisne sistema de turbina y conducci&oacute;n completamente de acero inoxidable.</p>', '<iframe width="560" height="315" src="http://www.youtube.com/embed/88DLBpd_P10?rel=0" frameborder="0" allowfullscreen></iframe>', '6050.00', NULL, NULL, NULL, NULL, 0, NULL, 0, '2011-10-13', '2012-08-19 17:39:02', NULL, NULL, NULL, NULL),
(182, 'Modulo Moche', 'modulo-moche', '<p><strong>MODULO  MOCHE  DE  5 TORRES HEXAGONALES</strong></p>\r\n<p>Confeccionado en madera huairuro.</p>\r\n<p><strong><span style="text-decoration: underline;">PRIMERA TORRE:</span></strong></p>\r\n<p>Estructura confeccionada en tubo negro estructural de 1&frac12;" x 2mm; con base cil&iacute;ndrica (0.80m) de concreto armado y plataforma de metal con piso de madera de 1.50m de altura con techo piramidal de fibra de vidrio pintado al horno.</p>\r\n<p>- 01 TUBO DE BOMBERO<br />- 01 CUPULA<br />- 01 MICHI<br />- 01 ESCALERA<br />- 01 TOBOGAN TUBULAR RECTO<br />- 01 PUENTE COLGANTE<br />- 01 DESLIZADOR AEREO</p>\r\n<p><strong><span style="text-decoration: underline;">SEGUNDA TORRE:</span></strong></p>\r\n<p>Estructura confeccionada en tubo negro estructural de 1&frac12;" x 2mm; con base cil&iacute;ndrica (0.80m) de concreto armado y plataforma de metal con piso de madera de 1.50m de altura con techo piramidal de fibra de vidrio pintado al horno.</p>\r\n<p>- 01 CUPULA<br />- 01 ESCALERA ESPIRAL<br />- 01 TOBOGAN ONDEADO ABIERTO<br />- 01 TEJIDO DE ARA&Ntilde;A<br />- 01 PUENTE EN ARCO</p>\r\n<p><strong><span style="text-decoration: underline;">TERCERA TORRE:</span></strong></p>\r\n<p>Estructura confeccionada en tubo negro estructural de 1&frac12;" x 2mm; con base cil&iacute;ndrica (0.80m) de concreto armado y plataforma de metal con piso de madera de 1.50m de altura con techo piramidal de fibra de vidrio pintado al horno.</p>\r\n<p>- 01 ESCALERA DE PASOS CUADRADOS<br />- 01 PUENTE DE DESNIVELES<br />- 01 CUPULA<br />- 01 ESCALERA DE CULEBRA<br />- 01 TOBOGAN CARACOL ABIERTO</p>\r\n<p><strong><span style="text-decoration: underline;">CUARTA TORRE:</span></strong></p>\r\n<p>Estructura confeccionada en tubo negro estructural de 1&frac12;" x 2mm; con base cil&iacute;ndrica (0.80m) de concreto armado y plataforma de metal con piso de madera de 1.50m de altura con techo piramidal de fibra de vidrio pintado al horno.</p>\r\n<p>- 01 MICHI<br />- 01 TUNEL AEREO CON CUBO<br />- 01 PASAMANOS DE TRIANGULOS<br />- 01 ESCALERA<br />- 01 TOBOGAN CARACOL TUBULAR</p>\r\n<p><strong><span style="text-decoration: underline;">QUINTA TORRE:</span></strong></p>\r\n<p>Estructura confeccionada en tubo negro estructural de 1&frac12;" x 2mm; con base cil&iacute;ndrica (0.80m) de concreto armado y plataforma de metal con piso de madera de 1.50m de altura con techo piramidal de fibra de vidrio pintado al horno.</p>\r\n<p>- 01 MICHI<br />- 01 CUPULA<br />- 01 ESCALERA<br />- 01 COLGANTE<br />- 01 TOBOGAN CURVO ABIERTO<br />- 01 PASAMANOS ZIG ZAG</p>\r\n<p><strong><span style="text-decoration: underline;">INFORME T&Eacute;CNICO:</span></strong></p>\r\n<p>Las torres y plataformas est&aacute;n confeccionadas en tubo negro estructural de 1&frac12;" x 2mm, los pisos del circuito confeccionados en madera huayruro acabado en una pulgada de espesor, por consideraci&oacute;n al uso publico debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br />Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (1&frac12;", 1&frac14;", &frac34;"), y varilla lisa de ⅜".<br />Pintado en esmalte al horno de diferentes colores.<br />Desarmables y ensamblados con pernos zincados.<br />Toboganes de fibra de vidrio pintado con hielco de color amarillo, rojo, azul y verde, laqueado en laca al horno transparente.<br />Plataformas debidamente ancladas al piso con concreto armado</p>', '<iframe width="560" height="315" src="http://www.youtube.com/embed/f1szAVCITVQ?rel=0" frameborder="0" allowfullscreen></iframe>', '60500.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-13', '2011-10-13 22:11:25', NULL, NULL, NULL, 1),
(183, 'Modulo Ciudad Nueva', 'modulo-ciudad-nueva', '<p>- Columna con piso de madera de 1m de altura y 1m&sup2; de &aacute;rea, con parantes de 2.40m de altura.<br />- Escalera con pasamano de madera y un metro de altura.<br />- Tobog&aacute;n abierto de fibra de vidrio de 1m de altura en dos colores.<br />- Rampa de madera de 1m de altura con sogas.<br />- Panel con c&uacute;pula de acr&iacute;lico.<br />- Seis techos piramidales de fibra de vidrio de 1m&sup2; en colores diferentes.<br />- Puente colgante, con piso de madera y pasamanos de metal.<br />- Columna de madera con piso de 1.20m de altura y 1m&sup2; de &aacute;rea con parantes de 2.60m de altura y techo de fibra de vidrio.<br />- Puente en forma de arco, con piso de madera y pasamanos de metal.<br />- Tobog&aacute;n tubular fibra de vidrio, 0.72m de di&aacute;metro y 1.50m de altura.<br />- Columna con piso de madera, de 1.50m de altura y 1m&sup2; de &aacute;rea, con parantes de 3.20m de altura.<br />- Rampa de madera de 1.50m de altura, con sogas.<br />- Tobog&aacute;n abierto de fibra de vidrio 1.50m de altura en dos colores.<br />-<strong> </strong>Escalera con pasamano de madera de 1.50m de altura.<br />- Pasamanos de metal circular de 2m de di&aacute;metro.<br />- Columna con piso de madera de 1.50m de altura, y 1m&sup2; de &aacute;rea, con parantes de 3.20m de altura.<br />-&nbsp;Tobog&aacute;n abierto de fibra de vidrio de 1.50m de altura, en dos colores.<br />- Escalera de metal modelo espiral.<br />- T&uacute;nel a&eacute;reo de fibra de vidrio formado por un cubo de 1m y dos cilindros de 1m de largo cada uno.<br />- Columna hexagonal con piso de madera de 1.80m de altura y parantes de 3.60m de altura.<br />- Tejido de sogas. (ara&ntilde;a)<br />- Tobog&aacute;n de fibra de vidrio modelo caracol de 0.72m de di&aacute;metro y 2m de altura. Modelo serpiente.<br />- Tubo de bomberos de metal.<br />- Una escalera culebra de metal.<br />- Un piso rampa de madera con pasamanos de metal.<br />- Un puente colgante con piso de madera y pasamanos de metal.<br />- Pasamanos de metal ondeado.<br />- Tobog&aacute;n de fibra de vidrio de 1.50m de altura en dos colores.<br />- Escalera con pasamanos de madera de 1.50m de altura.<br />- Rampa de madera con sogas de 1.50m de altura.<br />- Columna con piso de madera de 1.50m de altura, y parantes de 3.20m de altura.<br />- Tobog&aacute;n curvo abierto de 1.50m de altura de color entero.<br />- Deslizador de metal, a&eacute;reo, de 3.00m de largo.<br />- Escalera de piratas. (Sogas)<br />- Columpio triple. (balanc&iacute;n, asiento, calesa)<br />- Dos juegos michi de fibra de vidrio. (Tres en raya)</p>', '<iframe width="420" height="315" src="http://www.youtube.com/embed/dhqxut-rWt0?rel=0" frameborder="0" allowfullscreen></iframe>', '53900.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-13', '2011-10-13 22:11:23', NULL, NULL, NULL, 2),
(184, 'Modulo Los Manzanos', 'modulo-los-manzanos', '<p><strong>Area de 7m x 3m</strong></p>\r\n<p>02 toboganes de 1m de fibra de vidrio.<br /> 01 puente en arco.<br /> 01 tubo de bombero.<br /> 01 escalera de tubo cuadrado.<br /> 01 bodeguita.<br /> 01 escalera de madera.<br /> 01 juego de michi.<br /> 01 columpio triple (calesa, balanc&iacute;n y un asiento).</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Pisos de columnas confeccionadas en madera huayruro y parantes 3'''' x 3'''' de grosor, los pisos de circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por consideraci&oacute;n al uso p&uacute;blico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (2'''', 1'''', 1&frac14;'''', &frac34;'''') y varilla lisa de 3/4'''' pintado con anticorrosivo y esmalte al horno de diferentes colores.<br /> Desarmables y ensamblados en pernos zincados.<br /> Techos y toboganes abiertos de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Plataformas debidamente ancladas a 0.40 m de profundidad en vaciado de cemento previamente protegido con brea.<br /> Medida de 1.90m de altura por 2.80m de largo, la estructura est&aacute; confeccionado en tubo negro estructural, el travesa&ntilde;o es de 2'''' x 2mm y los parantes de 1&frac14;'''' x 2mm pintado con esmalte al horno, los columpios esta accionado por un sistema de rodajes (mayor durabilidad para el uso p&uacute;blico).</p>', NULL, '7150.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 19),
(185, 'Modulo Inicial', 'modulo-inicial', '<p><strong>Area de 3m x 5.20m</strong></p>\r\n<p>02 toboganes de 1m de fibra de vidrio. <br /> 01 puente colgante. <br /> 01 tubo de bombero. <br /> 01 escalera de tubo cuadrado. <br /> 01 bodeguita. <br /> 01 escalera de madera. <br /> 01 Juego tres en raya (michi).</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Pisos de columnas confeccionadas en madera huayruro y parantes 3'''' x 3'''' de grosor, los pisos de circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por  consideraci&oacute;n al uso publico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (2", 1", 1&frac14;", &frac34;&rdquo;), y varilla lisa de 3/4'''' pintado con anticorrosivo y esmalte al horno de diferentes colores.<br /> Desarmables y ensamblados con pernos zincados.<br /> Techos y toboganes abiertos de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Plataformas debidamente ancladas a 0.40m de profundidad en baseado de cemento previamente protegido con brea.</p>', NULL, '6050.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-14', '2011-10-15 11:19:53', NULL, NULL, NULL, 21),
(186, 'Modulo Callao', 'modulo-callao', '<p><strong>&Aacute;rea de 6m x 4.20m</strong></p>\r\n<p>Dos columnas con plataforma (de 0.60m x 0.60m).<br /> Dos techos piramidales de fibra de vidrio.<br /> Una bodeguita.<br /> Un  puente en arco, piso de madera y pasamanos de madera.<br /> Tobog&aacute;n ondeado de fibra de vidrio de 1m de altura.<br /> Un columpio triple (calesa, balanc&iacute;n y asiento individual).<br /> Una escalera de tubo cuadrado.<br /> Una escalera de madera.<br /> Un pasamano culebra de metal.<br /> Una escalera de metal.<br /> Tobog&aacute;n ondeado de 1m de fibra.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Las columnas con plataforma de 0.60m x 0.60m, est&aacute;n confeccionadas en madera huayruro y parantes de 3'''' x 3'''' de grosor, los pisos del circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por consideraci&oacute;n al uso publico debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (1&frac12;'''', 1&frac14;'''', &frac34;''''), y varilla lisa de 3/8'''' pintado en esmalte  al horno de diferentes colores.  Desarmables y ensamblados con pernos zincados.<br /> Toboganes de fibra de vidrio pintado con hielco de color amarillo, rojo, azul y verde; laqueado en laca al horno transparente.<br /> Plataformas, debidamente ancladas al piso con baseado de concreto  armado. Aplicaci&oacute;n de undercoating en las bases (brea).</p>', NULL, '8250.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 17),
(187, 'Modulo La Católica', 'modulo-la-catolica', '<p><strong>Area de 6m x 7m</strong></p>\r\n<p>Tobog&aacute;n caracol abierto de fibra de vidrio. <br /> Puente en arco fijo. <br /> T&uacute;nel de fibra de vidrio. <br /> Plataforma de 1.50m de altura. <br /> Plataforma de 1.70m de altura. <br /> Escalera espiral de metal. <br /> Escalera culebra. <br /> Tobog&aacute;n ondeado de 1.50m de fibra de vidrio. <br /> Escalera de pirata (sogas). <br /> Pasamanos curvo de metal. <br /> Juego tres en raya (michi). <br /> Techo piramidal de fibra de vidrio. <br /> Columpio doble con asientos de fibra de vidrio.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Plataformas confeccionadas en madera huayruro con parantes de 4'''' x  4'''' de grosor, los pisos del circuito confeccionados en madera huayruro de 1&frac14;'''' de grosor, por consideraci&oacute;n al uso publico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (2", 1&frac12;'''', 1&frac14;'''', 1'''', &frac34;'''' x 2mm de espesor), y varilla lisa redonda de ⅜&rdquo; pintado con anticorrosivo y esmalte al horno de diferentes colores.<br /> Desarmables y ensamblados con pernos zincados.<br /> Techos y toboganes abiertos y tubulares de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Plataformas debidamente ancladas a 0.40m de profundidad en vaciado de cemento previamente protegido con brea.</p>', NULL, '13750.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-14', '2011-10-15 11:19:45', NULL, NULL, NULL, 9),
(188, 'Modulo Monterrico', 'modulo-monterrico', '<p><strong>Area de 6m x 7m</strong></p>\r\n<p>Tobog&aacute;n caracol abierto de fibra de vidrio. <br /> Puente en arco fijo. <br /> T&uacute;nel de fibra de vidrio. <br /> Plataforma de 1.50m de altura. <br /> Plataforma de 1.70m de altura. <br /> Escalera espiral de metal. <br /> Escalera culebra. <br /> Tobog&aacute;n ondeado de 1.50m de fibra de vidrio. <br /> Escalera de pirata (sogas). <br /> Pasamanos tipo culebra. <br /> Juego tres en raya (michi). <br /> Techo piramidal de fibra de vidrio. <br /> Columpio doble con asientos de fibra de vidrio.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Plataformas confeccionadas en madera huayruro con parantes de 4'''' x  4'''' de grosor, los pisos del circuito confeccionados en madera huayruro de 1&frac14;'''' de grosor, por consideraci&oacute;n al uso publico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (2", 1&frac12;'''', 1&frac14;'''', 1'''', &frac34;'''' x 2mm de espesor), y varilla lisa redonda de 3/8'''' pintado con anticorrosivo y esmalte al horno de diferentes colores.<br /> Desarmables y ensamblados con pernos zincados.<br /> Techos y toboganes abiertos y tubulares de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Plataformas debidamente ancladas a 0.40m de profundidad en vaciado de cemento previamente protegido con brea.</p>', NULL, '13500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 10);
