(189, 'Modulo San Juan', 'modulo-san-juan', '<p><strong>&Aacute;rea de 6m x 5m</strong></p>\r\n<p>Dos columnas con plataforma (de 0.60m x 0.60m).<br /> Dos techos piramidales de fibra de vidrio.<br /> Un t&uacute;nel de nordex  pintado en esmalte sint&eacute;tico.<br /> Un  puente en arco, piso de madera y pasamanos de madera.<br /> Tobog&aacute;n ondeado de fibra de vidrio de 1.50m de altura.<br /> Un michi de madera (tres en raya).<br /> Una escalera con pasos curvos de metal.<br /> Una escalera espiral de metal pintado al horno.<br /> Una escalera sube o baja culebra de metal.<br /> Un pasamano culebra de metal.<br /> Escalera de pirata (sogas).<br /> Tobog&aacute;n ondeado de 1.20m de fibra.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Las columnas con plataforma est&aacute;n confeccionadas en madera huayruro y parantes de 3'''' x 3'''' de grosor, los pisos del circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por consideraci&oacute;n al uso publico debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (1&frac12;'''', 1&frac14;'''', &frac34;''''), y varilla lisa de 3/8'''' pintado en esmalte  al horno de diferentes colores.<br /> Desarmables y ensamblados con pernos zincados.<br /> Toboganes de fibra de vidrio pintado con hielco de color amarillo, rojo, azul y verde; laqueado en laca al horno transparente.<br /> Plataformas, debidamente ancladas al piso con baseado de concreto  armado. Aplicaci&oacute;n de undercoating en las bases (brea).</p>', NULL, '10450.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 14),
(190, 'Modulo Madre de Dios', 'modulo-madre-de-dios', '<p>Cuatro columnas con plataforma (de 1m x 1m). <br /> Cuatro techos de fibra de vidrio tipo selva. <br /> Un t&uacute;nel de fibra de vidrio pintado en esmalte al horno. <br /> Un puente colgante, piso de madera y pasamanos de madera Huayruro. <br /> Un  puente en arco, piso de madera y pasamanos de madera. <br /> Un tubo bombero de metal pintado en esmalte al horno. <br /> Una rampa de madera (con sogas tipo alpinista). <br /> Tobog&aacute;n tubular caracol de fibra de vidrio de 2.20m de altura con cabeza de serpiente. <br /> Tobog&aacute;n caracol abierto de fibra de vidrio de 2m de altura. <br /> Un michi de madera (tres en raya). <br /> Dos escaleras con pasos de madera. <br /> Una escalera sube o baja culebra  de metal. <br /> Un pasamano curvo de metal. <br /> Escalera de pirata (sogas). <br /> Tobog&aacute;n curvo de fibra de vidrio. <br /> Puente de escalones.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Las columnas con plataforma est&aacute;n confeccionadas en madera huayruro y parantes de 4'''' x 4'''' de grosor, los pisos del circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por consideraci&oacute;n al uso publico debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente. <br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (1&frac12;'''', 1&frac14;'''', &frac34;''''), y varilla lisa de 3/8''''. Pintado en esmalte  al horno de diferentes colores. <br /> Desarmables y ensamblados con pernos zincados. <br /> Toboganes de fibra de vidrio pintado con hielco de color amarillo, rojo, azul y verde laqueado en laca al horno transparente. <br /> Plataformas decoradas con hojas de enredadera y otros artificiales, debidamente ancladas al piso con baseado de concreto armado. <br /> Aplicaci&oacute;n de undercoating en las bases (brea).</p>', NULL, '38500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 3),
(191, 'Modulo Cesar Vallejo', 'modulo-cesar-vallejo', '<p><strong>Area de 6.70m x 5.60m</strong></p>\r\n<p>01 Columpio triple (calesa, balanc&iacute;n y 1 asiento de madera). <br /> 01 Tobog&aacute;n de 1.20m. <br /> 01 Puente Fijo. <br /> 01 Trepado escalera de pirata (1.80m de altura x 2m de largo). <br /> 01 Escalera con pasos de madera. <br /> 01 Tubo de Bomberos. <br /> 01 Escalera de culebra. <br /> 01 Michi.</p>\r\n<p><strong>Informe T&eacute;cnico: </strong><br /> Los parantes de metal es de tubo negro estructural de 1&frac12;'''' x 2mm pintado al horno. <br /> El puente mide 1.80m de largo y de ancho 1m. <br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (1&frac12;'''', 1&frac14;'''', &frac34;'''') y varilla lisa de 3/8'''' pintado en esmalte  al horno de diferentes colores. <br /> Desarmables y ensamblados con pernos zincados. <br /> Tobog&aacute;n de fibra de vidrio de 4mm de espesor, pintado con hielco  bicolor laqueado en laca  al horno transparente. <br /> Asientos del columpio son de  madera huayruro con cadena galvanizada 3/16.</p>', NULL, '8250.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 18),
(192, 'Modulo Santa Eulalia', 'modulo-santa-eulalia', '<p><strong>Area de 6m x 7m</strong></p>\r\n<p>Tobog&aacute;n caracol abierto de fibra de vidrio. <br /> Puente en arco fijo. <br /> T&uacute;nel de fibra de vidrio. <br /> Plataforma de 1.50m de altura. <br /> Plataforma de 1.70m de altura. <br /> Escalera espiral de metal. <br /> Escalera culebra. <br /> Tobog&aacute;n mellizo ondeado de 1.50m de fibra de vidrio. <br /> Escalera de pirata (sogas). <br /> Pasamanos curvo de metal. <br /> Juego tres en raya (michi). <br /> Techo piramidal de fibra de vidrio. <br /> Columpio triple (calesa ,asiento y balanc&iacute;n).</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Plataformas confeccionadas en madera huayruro con parantes de 4'''' x  4'''' de grosor, los pisos del circuito confeccionados en madera huayruro de 1&frac14;'''' de grosor, por consideraci&oacute;n al uso p&uacute;blico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (2", 1&frac12;'''', 1&frac14;'''', 1'''', &frac34;'''' x 2mm de espesor), y varilla lisa redonda de ⅜&rdquo; pintado con anticorrosivo y esmalte al horno de diferentes colores.<br /> Desarmables y ensamblados con pernos zincados.<br /> Techos y toboganes abiertos y tubulares de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Plataformas debidamente ancladas a 0.40m de profundidad en vaciado de cemento previamente protegido con brea.</p>', '<iframe width="560" height="315" src="http://www.youtube.com/embed/dQyL-JyNKnw?rel=0" frameborder="0" allowfullscreen></iframe>', '14950.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 7),
(193, 'Modulo Castilla', 'modulo-castilla', '<p><strong>&Aacute;rea de 8m x 5.60m</strong></p>\r\n<p>01 puente en arco.<br /> 01 tobog&aacute;n de 1.20m.<br /> 01 tobog&aacute;n de 1.50m.<br /> 01 t&uacute;nel.<br /> 01 michi.<br /> 01 columpio triple.<br /> 01 escalera espiral.<br /> 01 pasamanos culebra.<br /> 01 tubo de bombero.<br /> 01 trepado de sogas.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Pisos de columnas confeccionadas en madera huayruro y parantes 3'''' x 3'''' de grosor, los pisos de circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por  consideraci&oacute;n al uso publico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (2", 1", 1&frac14;", &frac34;''''), y varilla lisa de 3/4'''' pintado con anticorrosivo y esmalte al horno de diferentes colores.<br /> Desarmables y ensamblados con pernos zincados.<br /> Techos y toboganes abiertos de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Plataformas debidamente ancladas a 0.40m de profundidad en baseado de cemento previamente protegido con brea.</p>', NULL, '11550.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 15),
(194, 'Modulo Castilla Baby', 'modulo-castilla-baby', '<p><strong>&Aacute;rea de 6.80m x 4.70m</strong></p>\r\n<p>01 puente en arco.<br /> 01 tobog&aacute;n de 1m.<br /> 01 columpio triple (calesa, asiento y balanc&iacute;n).<br /> 01 trepado de sogas.<br /> 01 tobog&aacute;n de 1.20m.<br /> 01 tubo de bombero.<br /> 01 escalera de madera.<br /> 01 escalera de metal cuadrado.<br /> 01 bodeguita.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Pisos de columnas confeccionadas en madera huayruro y parantes 3'''' x 3'''' de grosor, los pisos de circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por  consideraci&oacute;n al uso publico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (2", 1", 1&frac14;", &frac34;''''), y varilla lisa de 3/4'''' pintado con anticorrosivo y esmalte al horno de diferentes colores. Desarmables y ensamblados con pernos zincados.<br /> Techos y toboganes abiertos de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Plataformas debidamente ancladas a 0.40m de profundidad en baseado de cemento previamente protegido con brea.</p>', NULL, '9438.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 16),
(195, 'Modulo Cubo', 'modulo-cubo', '<p><strong>Area de 5m x 3.30m</strong></p>\r\n<p>Una columna de madera huayruro con parantes de 3'''' x 3'''' y plataforma de 1m x 1m x 3.20m techo de 2 aguas, sombrilla de tela doble faz de 4 colores (rojo, verde, amarillo, azul).<br /> Una rampa de sogas. <br /> Un tobog&aacute;n de fibra de vidrio de 1m de altura. <br /> Un columpio triple (calesa, balanc&iacute;n y un asiento). <br /> Un cubo de aglomerado de pino pintado de colores con 2 entradas. <br /> Una escalera de metal.</p>', NULL, '4950.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 23),
(196, 'Modulo 2 Codos', 'modulo-2-codos', '<p><strong>&Aacute;rea de 4.72m x 3.65m</strong></p>\r\n<p>Dos columnas con plataforma (de 1m x 1m).<br /> Dos techos piramidales de fibra de vidrio.<br /> Una escalera espiral de metal pintado al horno.<br /> Una escalera sube y baja culebra de metal.<br /> Tobog&aacute;n ondeado de fibra de vidrio de 1.20m de altura.<br /> Una escalera de pasos cuadrados.<br /> Un michi de madera (tres en raya).<br /> Dos t&uacute;neles de codo de fibra de vidrio (0.65cm de di&aacute;metro).<br /> Un trepado de sogas.<br /> Un tobog&aacute;n ondeado de Fibra de vidrio 1.50m de altura.<br /> Un pasamano de curvo metal.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Las columnas con plataforma est&aacute;n confeccionadas en madera huayruro y  parantes de 3'''' x 3'''' de grosor, los pisos del circuito confeccionados en madera huayruro  acabado en una pulgada de grosor, por consideraci&oacute;n al uso p&uacute;blico debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (1&frac12;'''', 1&frac14;'''', &frac34;''''), y varilla lisa de 3/8'''' pintado en esmalte al horno de diferentes colores.<br /> Desarmables y ensamblados con pernos zincados.<br /> Toboganes de fibra de vidrio pintado con hielco de color amarillo, rojo, azul y verde laqueado en laca al horno transparente.<br /> Plataformas, debidamente ancladas al piso con baseado de concreto  armado.</p>', NULL, '12100.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 12),
(197, 'Modulo San Martin', 'modulo-san-martin', '<p>Tobog&aacute;n ondeado mellizo de 1.20m de altura. <br /> Dos rampa de madera. <br /> Plataforma de 1.20m de altura. <br /> Plataforma de 1m de altura. <br /> Plataforma de 0.70m de altura. <br /> Escalera culebra de metal. <br /> Tobog&aacute;n  de 1m de fibra de vidrio. <br /> Escalera pirata de sogas. <br /> Juego tres en raya (michi). <br /> Techo piramidal de fibra de vidrio. <br /> Columpio triple  calessa, asiento de madera y balanc&iacute;n.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Pisos de columnas confeccionadas en madera capirona  o huayruro de 0.90m x 0.90m y parantes 3'''' x  3'''' de grosor, los pisos del circuito confeccionados en madera capirona o huayruro acabado en una pulgada de grosor, por consideraci&oacute;n al uso publico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas pintado con anticorrosivo y esmalte al horno de diferentes colores. Desarmables y ensamblados con pernos zincados.<br /> Techos y toboganes abiertos y tubulares de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Plataformas debidamente ancladas a 0.40m de profundidad en vaciado de concreto.</p>', NULL, '10450.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 13),
(198, 'Modulo Cieneguilla ', 'modulo-cieneguilla', '<p><strong>Area de 4m x 8m</strong></p>\r\n<p>Tres columnas con plataforma (de 1m x 1m). <br /> Tres techos de fibra de vidrio piramidal. <br /> Un puente colgante, piso madera y pasamanos de metal. <br /> Un puente en arco, piso de madera y pasamanos de metal. <br /> Una rampa de madera (con pasos tipo alpinista). <br /> Un michi de madera (tres en raya). <br /> Una escalera con pasos de madera. <br /> Una escalera sube y baja culebra de metal(zigzag). <br /> Un pasamano curvo metal. <br /> Un trepado de sogas (escalera pirata). <br /> Un tobog&aacute;n de fibra de vidrio de 1.20m de altura. <br /> Un tobog&aacute;n de fibra de vidrio de 1.50m de altura. <br /> Un columpio triple (tres asientos de fibra). <br /> Una escalera espiral metal.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Las columnas con plataforma esta confeccionada en medra huayruro y parantes de 4'''' x 4'''' de grosor, los pisos del circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por consideraci&oacute;n al uso p&uacute;blico debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos confeccionados en tubo negro estructural de diferentes mediadas (1&frac12;'''', 1&frac14;'''', &frac34;''''), y varilla lisa de 3/8''''. Pintado en esmalte al horno de diferentes colores.<br /> Desarmados y ensamblados con pernos zincados.<br /> Toboganes de fibra de vidrio con hielco de color amarillo, rojo, azul y verde laqueado en laca al horno transparente, ancladas al piso con base de concreto armado.<br /> Aplicaci&oacute;n de undercoating en las bases (brea).</p>', NULL, '18000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 6),
(199, 'Modulo Dangelo', 'modulo-dangelo', '<p>Estructura confeccionado en tubo negro de metal de 1&frac12;'''' x 2mm de pared, pintado al horno color verde pizarra.<br /> Una torre  de metal (tubo negro de 1&frac12;'''' x 2mm)con plataforma de 1.40m x 1.40m en madera huayruro color natural (laqueado y barnizado).<br /> Un techo piramidal de madera huayruro, laqueado y barnizado color natural de 1.40m x 1.40m.<br /> Dos plataformas triangulares de madera huayruro, laqueado y barnizado color natural.<br /> Pasamanos de metal con escalera y travesa&ntilde;os de tubo de 3/4'''' x 2mm de pared.<br /> Dos asientos de columpio en  madera huayruro laqueado y barnizado color natural con cadena galvanizada de 1/4.<br /> Un tobog&aacute;n ondeado abierto de 1.50m en fibra de vidrio color verde selva.<br /> Una escalera de metal pasos cuadrados.<br /> Una banca de madera huairuro laqueado y barnizado color natural.<br /> Una pizarra de 1.40m x 1.20m.</p>', NULL, '5500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-14', NULL, NULL, NULL, NULL, 22),
