(214, 'Modulo Magdalena', 'modulo-magdalena', '<p>Modulo matera metal de 03 columnas con carpas de tela, confeccionado en madera huayruro y tubo negro estructural, juegos que incluyen:</p>\r\n<p>01 tobog&aacute;n 1m.<br /> 01 tobog&aacute;n 1.20m.<br /> 01 escalera de madera.<br /> 01 puente fijo (recto).<br /> 01 puente colgante.<br /> 01 trepador de sogas.<br /> 01 escalera de tubo cuadrado de metal.<br /> 01 escalera culebra metal.<br /> 01 juego michi.<br /> 01 juego escalador.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Pisos de columnas confeccionadas en madera huayruro con parantes de madera y metal, los pisos de circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por consideraci&oacute;n al uso publico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (3/4'''', 1'''', 1&frac14;'''', 1&frac12;'''') y varilla lisa de  3/4'''' pintado con anticorrosivo y esmalte al horno de diferente colores.<br /> Toboganes abiertos de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Plataformas debidamente ancladas a 40cm de profundidad en baseado de cemento previamente protegido con brea.</p>', '<iframe width="560" height="315" src="http://www.youtube.com/embed/62e7FTuYTLo?rel=0" frameborder="0" allowfullscreen></iframe>', '6800.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-11-21', '2011-11-21 15:28:23', NULL, NULL, NULL, 20),
(215, 'Silla Personal', 'silla-personal', '<p>Confeccionado en tubo cuadrado de ⅞&rdquo; pintado en esmalte al horno en colores al escoger, respaldar y sentadera confeccionado en placa masisa (aglomerado de pino) enchapado en formica post-forming en colores variados.</p>\r\n<p><strong>Medidas de respaldar:</strong> (29cm x 15cm).<br /> <strong>Medidas de la sentadera:</strong> (29 cm. x 24 cm).<br /> <strong>Altura de la sentadera al piso:</strong> (30 cm).</p>', NULL, '66.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-11-28', NULL, NULL, NULL, NULL, NULL),
(216, 'Tobogán de Piscina Curvo', 'tobogan-de-piscina-curvo', '<p>Confeccionado en fibra de vidrio de 4mm de espesor, 60cm de ancho y 40cm de profundidad, pintado con hielco (pintura elaborado con resina y color lek) el modelo es curvo abierto, estructura de escalera de metal (tubo negro de 2'''', 1&frac12;'''', 1'''', &frac34;'''' x 2mm) y pasos de fibra de vidrio contra placado, estructura pintado con base zincromato y pintura al horno color azul, 2m de altura y 3.50m de largo, incluye bomba de agua.</p>', NULL, '4400.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-12-30', NULL, NULL, NULL, NULL, NULL),
(217, 'Modulo Inicial Baby', 'modulo-inicial-baby', '<p>Confeccionado en madera huayruro, medidas de 1.20m x 1.20m y de altura 1.20m, laqueado y barnizado,  pintado en colores, incluye un tobog&aacute;n de formica de 0.60cm de altura.</p>', NULL, '1800.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-12-30', '2012-05-04 22:20:42', NULL, NULL, NULL, 25),
(218, 'Modulo Bertolt Brecht', 'modulo-bertolt-brecht', '<p><strong>Area de 6m x 7m</strong></p>\r\n<p>Tobog&aacute;n caracol abierto de fibra de vidrio.<br /> Puente en arco fijo.<br /> T&uacute;nel de fibra de vidrio.<br /> Plataforma de 1.50m de altura.<br /> Plataforma de 1.70m de altura.<br /> Escalera espiral de metal.<br /> Escalera culebra.<br /> Tobog&aacute;n ondeado de 1.50m de fibra de vidrio.<br /> Escalera de pirata (sogas).<br /> Rampa de palestras de fibra de vidrio.<br /> Juego tres en raya (michi).<br /> Techo piramidal de fibra de vidrio.<br /> Escalera de pirata con sogas.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Plataformas confeccionadas en madera huayruro con parantes de 4'''' x  4'''' de grosor, los pisos del circuito confeccionados en madera huayruro de 1&frac14;'''' de grosor, por consideraci&oacute;n al uso publico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (2", 1&frac12;'''', 1&frac14;'''', 1'''', &frac34;'''' x 2mm de espesor), y varilla lisa redonda de ⅜'''' pintado con anticorrosivo y esmalte al horno de diferentes colores.<br /> Desarmables y ensamblados con pernos zincados.<br /> Techos y toboganes abiertos y tubulares de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Plataformas debidamente ancladas a 40cm de profundidad en vaciado de cemento previamente protegido con brea.</p>', NULL, '15000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2012-01-02', NULL, NULL, NULL, NULL, 8),
(219, 'Modulo Contadores', 'modulo-contadores', '<p>Tres columnas con plataforma (de 1.00m x 1.00m con techo de fibra de vidrio).<br /> Un t&uacute;nel de fibra de vidrio pintado en esmalte al horno.<br /> Un puente colgante, piso de madera y pasamanos de metal.<br /> Tubo de bombero de metal pintado en esmalte al horno.<br /> Una rampa de madera (con sogas tipo alpinista).<br /> Dos toboganes de fibra de vidrio de 1.00m y 1.50m de altura.<br /> Un michi de madera (tres en raya).<br /> Un tejido tipo ara&ntilde;a con marco de metal.<br /> Una escalera con pasos de madera.<br /> Una escalera sube o baja culebra  de metal.<br /> Una escalera modelo espiral de metal.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Las columnas con plataforma est&aacute;n confeccionadas en madera huayruro y parantes de 4'''' x 4'''' de grosor, los pisos del circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por consideraci&oacute;n al uso publico debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (1&frac12;'''', 1&frac14;'''', &frac34;''''), y varilla lisa de ⅜'''', pintado en esmalte  al horno de diferentes colores. Desarmables y ensamblados con pernos zincados.<br /> Toboganes de fibra de vidrio pintado con hielco de color amarillo, rojo, azul y verde.<br /> Laqueado en laca al horno transparente.<br /> Columnas consideradas a 40 cm de anclaje.</p>', NULL, '12750.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2012-01-02', NULL, NULL, NULL, NULL, 11),
(220, 'Piscina Cuadrada 1.70m', 'piscina-cuadrada-170m', '<p>Dimensiones 1.70m x 1.70m<br /> Altura 45cm<br /> Diametro interior 1.50m<br /> Colores a escoger<br /> Piezas incluidas: 1 piscina, 300 pelotas.<br /> Materiales: lino plastificado lavable, espuma de alta densidad.</p>', NULL, '1500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2012-01-06', '2012-05-04 22:20:31', NULL, NULL, NULL, NULL),
