(229, 'Modulo Tren Inicial', 'modulo-tren-inicial', '<p class="MsoNormal"><strong><span style="text-decoration: underline;"><span lang="ES">DESCRIPCION DEL JUEGO:</span></span></strong></p>\r\n<p class="MsoNormal"><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span lang="ES">Dos columnas con plataforma (de 1.0mt x1.0mt)madera huayruro</span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">UN&nbsp; techo de madera modelo arco...</span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">Un michi de madera (tres en raya).</span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">Una escalera con pasos y pasamanos&nbsp; de madera.</span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">Un tobog&aacute;n de fibra de vidrio de 1.00mt de altura.</span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">Una rampa de madera.</span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">Un puente con pasamanos de madera y tejido de sogas..</span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">Un t&uacute;nel de madera </span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">16 ruedas de fifra de vidrio contraplacado.</span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">Una portada de fibra de vidrio en tobog&aacute;n.</span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">Plataformas con barandas de madera.</span></p>\r\n<p class="MsoNormal"><!--[if !supportLists]--><span lang="ES">-<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="ES">Dos timones de metal.</span></p>\r\n<p class="MsoNormal"><span lang="ES">&nbsp;</span></p>\r\n<p class="MsoNormal"><strong><span style="text-decoration: underline;"><span lang="ES">INFORME T&Eacute;CNICO:</span></span></strong><strong></strong></p>\r\n<p class="MsoListParagraph" style="text-align: justify;"><strong><span lang="ES">-<span style="white-space: pre;"> <span style="white-space: pre;"> </span></span><strong>Pisos de columnas confeccionadas en madera huairuro y parantes 3&rdquo; x 3&rdquo; <span style="white-space: pre;"> <span style="white-space: pre;"> </span></span>de grosor, los pisos de circuito confeccionados en madera huairuro acabado <span style="white-space: pre;"> <span style="white-space: pre;"> </span></span>en una pulgada de grosor, por&nbsp; consideraci&oacute;n al uso p&uacute;blico, debe ser <span style="white-space: pre;"> <span style="white-space: pre;"> </span></span>duradero y resistente, totalmente laqueado y barnizado en barniz marino <span style="white-space: pre;"> <span style="white-space: pre;"> </span></span>transparente.</strong></span></strong><strong></strong></p>\r\n<p style="text-align: justify;"><strong><span lang="ES">-<span style="white-space: pre;"> <span style="white-space: pre;"> </span></span>Plataformas debidamente ancladas a 0.40m de profundidad en baseado de <span style="white-space: pre;"> <span style="white-space: pre;"> </span></span>cemento previamente protegido con brea.</span></strong></p>', '', '9500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2013-12-23', NULL, NULL, NULL, NULL, NULL),
(230, 'Modulo El Porvenir', 'modulo-el-porvenir', '<p class="MsoNormal"><strong><span style="text-decoration: underline;"><span lang="IT">DESCRIPCI&Oacute;N</span></span></strong><strong><span style="text-decoration: underline;"></span></strong></p>\r\n<ol type="1">\r\n<li class="MsoNormal"><span lang="ES">Tobog&aacute;n caracol abierto de fibra de vidrio.</span></li>\r\n<li class="MsoNormal"><span lang="ES">Puente en arco fijo.</span></li>\r\n<li class="MsoNormal"><span lang="ES">T&uacute;nel de fibra de vidrio.</span></li>\r\n<li class="MsoNormal"><span lang="ES">Plataforma de 1.50m de altura.</span></li>\r\n<li class="MsoNormal"><span lang="ES">Plataforma de 1.70m de altura.</span></li>\r\n<li class="MsoNormal"><span lang="ES">Escalera espiral de metal.</span></li>\r\n<li class="MsoNormal"><span lang="ES">Escalera culebra.</span></li>\r\n<li class="MsoNormal"><span lang="ES">Dos escaleras de pirata (sogas).</span></li>\r\n<li class="MsoNormal"><span lang="ES">Rampa de palestras de fibra de vidrio</span></li>\r\n<li class="MsoNormal"><span lang="ES">Juego tres en raya (michi)</span></li>\r\n<li class="MsoNormal"><span lang="ES">Techo piramidal de fibra de vidrio.</span></li>\r\n<li class="MsoNormal"><span lang="ES">Pasamanos.</span></li>\r\n<li class="MsoNormal"><span lang="ES">Casita de madera.</span></li>\r\n<li class="MsoNormal"><span lang="ES">Deslizador a&eacute;reo (tirolina.)</span></li>\r\n<li class="MsoNormal"><span lang="ES">Puente colgante.</span><strong></strong></li>\r\n</ol>\r\n<p class="MsoNormal"><strong><span style="text-decoration: underline;"><span lang="ES">INFORME T&Egrave;CNICO: </span></span></strong><strong><span lang="ES">&nbsp;&nbsp;&nbsp;&nbsp;</span></strong></p>\r\n<ul style="text-align: justify;">\r\n<li>Plataformas confeccionadas en madera huayruro con parantes de 4&rdquo; x&nbsp; 4&rdquo;de grosor, los pisos del circuito confeccionados en madera huayruro de 1&frac14;&rdquo;de grosor, por consideraci&oacute;n al uso p&uacute;blico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.</li>\r\n<li>Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (2", 1&frac12;&rdquo;, 1&frac14;&rdquo;, 1&rdquo;, &frac34;&rdquo; x 2mm. De espesor), y varilla lisa redonda de ⅜&rdquo; pintado con anticorrosivo y esmalte al horno de diferentes colores.</li>\r\n<li>Desarmables y ensamblados con pernos zincados.</li>\r\n<li>Techos y toboganes abiertos y tubulares de fibra de vidrio, pintados con hielco de diferentes colores y laqueados en laca al horno transparente.</li>\r\n<li>Plataformas debidamente ancladas a 0.40m de profundidad en vaciado de cemento previamente protegido con brea.</li>\r\n</ul>', '', '22500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2013-12-24', NULL, NULL, NULL, NULL, NULL),
